(11, 'Alfa Romeo', 'alfa-romeo', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Alfa Romeo</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Alfa Romeo</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Founded in 1910, Alfa Romeo S.P.A Automobiles is one of the industry-leading automobile manufacturers who specialize in producing a wide range of luxury cars. The hallmark of the Alfa Romeo cars is stylish design as this Italian automobile manufacturer has produced some of the sleekest, high-end car that the world has ever witnessed.</p>\r\n<p>Despite the class associated with this brand, you may have a used Alfa Romeo car that you want to sell and make quick cash on it. Do not get worked up in your search for a reliable buyer, let Expat Car Buyers offer you the unmatched services you need by buying your Alfa Romeo car at a competitive price in a jiffy. No matter the model of your Alfa Romeo, we are guaranteeing you the quick and easy sale of your car at the right value. Car owners can enjoy our dependable services in Abu Dhabi, Dubai, Al Ain and other cities in UAE.</p>\r\n<p>Whether you have plans to sell and upgrade your Alfa Romeo car or you are in need of quick cash to take care of your emergency needs, our experienced and versatile car buyers at Expat Car Buyers will come to your aid by buying your car quickly. From Giulietta to Giulia, Stelvio, 4C Spider or any other models of Alfa Romeo, we are ready to buy your car on the spot.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/alfa-romeo-3613375_640.webp\" alt=\"Alfa Romeo\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/alfa-romeo-3613375_640.jpg\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Alfa Romeo</span> Giulietta</h3>\r\n<p class=\"font-mons text-white py-2\">One of the most common Alfa Romeo cars that we have bought in the past from many customers is the Alfa Romeo Giulietta. First produced in 1954, Giulietta came in coupe, sedan, estate, and other body styles and was one of the favorite cars of many wealthy individuals during its prime. The third and last generation of this car was produced in 2010 with various advanced modifications.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">Alfa Romeo </span>Giulia</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Unveiled in 1962, the Alfa Romeo Giulia was hailed as one of the trailblazing four-door sedans that were enjoyed by many Europeans in the 1960s and 1970s. The lightweight body and powerful engine gave this Type 105 its allure and prestige during this time. Although the initial production of this car was stopped in 1992, the production of its new generation began in 2015. This latest generation of the Alfa Romeo Giulia is a compact executive car which is otherwise known as the Type 952.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Alfa Romeo </span>Quickly for Cash</h3>\r\n<p class=\"font-mons text-white py-2\">Where can I sell my Alfa Romeo car fast in Dubai, Abu Dhabi or other locations in UAE? Perhaps this is the question you are asking now. Speak to our seasoned and courteous car professionals at Expat Car Buyers today online or at our office. To ensure that you do not experience any delay in selling your car, we will respond to your inquiry instantly.</p>\r\n<p class=\"font-mons text-white py-2\">Our experts will conduct a comprehensive inspection of your car with no obligation and then offer you a quote based on the current market value and condition of your Alfa Romeo. Within 30 minutes of accepting the quote offered for your Alfa Romeo car, we will provide you cash. No delay. No excuse.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell Alfa Romeo | Get Your Alfa Romeo Evaluated in UAE', NULL, 'Want to sell your car? Sell your Alfa Romeo to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:17:18', '2019-03-05 07:01:32'),
(10, 'Acura', 'acura', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Acura</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Acura</span></h2>\r\n<p>Since the inception of the production of their luxury cars in 1986, Acura has continued to provide high-performance vehicles that are suitable for various purposes. As a division of Honda, the goal of this brand is to produce luxury Japanese cars that can compete with many other luxury brands around the globe. Today, Acura has been giving everyone around the world classy luxury cars that are energy-efficient, durable and safe.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 40px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Are you looking for answers to &ldquo;where can I sell my Acura car&rdquo;? Expat Car Buyers is the team you can count on for your car sales. With the help of our skilled car professionals, you do not have to go through the excruciating process of looking for a buyer for your Acura. We are always on ground to provide quick cash for your Acura in just 30 minutes.</p>\r\n<p>Whether you are in Dubai, Abu Dhabi or any other cities within the United Arabic Emirates, our professional car buyers at Expat Car Buyers are always ready to take you through an efficient car sale process. Once you have booked an appointment with us, we will take our time to <a style=\"color: #d32f2f;\" href=\"/sell-any-car\">inspect and value your car</a>. With the aid of our expertise and experience, a deal can be completed quickly, and you will get cash instantly.</p>\r\n<p>At Expat Car Buyers, we can buy several models of Acura including the popular Acura Integra and Acura Legend.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/why-car.webp\" alt=\"Acura\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/why-car.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Acura</span> Integra</h2>\r\n<p class=\"font-mons text-center text-white py-4\">The first generation of Acura Integra was a hatchback luxury car that came with a 1.6L engine. Though it came with two options of 3-door and 5-door models, it was one of the ultimate luxury cars during the time it was first produced. Its beautiful interior made it one of the favorites of many individuals then and lots of people will still love to own one today.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\"><span class=\"theme-color font-weight-bold\">Acura</span> Legend</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Acura Legend is known as one of the foremost and most popular luxury cars manufactured by Honda in collaboration with Austin Rover Group. Due to its success in different countries around the world, more than 55,000 units of the Acura Legend was sold in the first year of its sale, and many more have been sold over the years. Although the first set of the production of this car was a sedan with the 2.5L V6 engine, it has undergone several changes.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Sell Your Acura</span> Cars Now</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Irrespective of the model of Acura cars you want to sell, Expat Car Buyers is the team you can rely on for the best values and quick cash for your Acura. As a Dubai-based company, we service the needs of all owners of Acura cars in UAE with our comfortable, seamless and simple sale process. Our seasoned car experts will put you through the process of selling your car to us, and we guarantee you that you will get a competitive price on your Acura in just 30 minutes.</p>\r\n<p class=\"font-mons text-center text-white\">Are you ready to get started today? Fill our booking form above now and let us offer you cash for your Acura as soon as possible.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Acura | Get Your Acura Evaluated in UAE', NULL, 'Want to sell your Acura? Sell your car to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 07:24:33', '2019-03-05 07:01:05'),
