(15, 'Aston Martin', 'aston-martin', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Aston Martin</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Aston Martin</span></h2>\r\n<p>The luxurious sport brand is an independent maker of automobile that sourced its name from the founder, Lionel Martin. Well, it is no hidden thing that for everything that goes on in the company, there is a beauty backing it up. All over the world, the Aston Martin have been well recognised in creating the best of rides.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 40px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\">Sell my <span class=\"font-weight-bold theme-color\">Aston Martin </span>Vanguish S</h3>\r\n<p>Styling on the heritage and achievement of the flagship Grand Tourer of the company comes the Aston Martin Vanquish S &ndash; coming along with advance engine power, improved dynamics and all new design, so as to create a ride of unprecedented capacity. The ride is the ultimate Super GT.</p>\r\n<h3 class=\"font-weight-light\">Sell my <span class=\"font-weight-bold theme-color\">Aston Martin </span>Rapide S</h3>\r\n<p>Bright styling, ability to feel pleasure through touch and a sense of connection are utmost, and from the initial time you slip behind the steering wheel, you have the sense of being in full command of the car. Beautiful sight and the sensory satisfaction from styling materials that include; glass switches, are carefully considered and very satisfying, accomplishing a driving experience so immersive that you will have to be reminded that you are in a four-seater sports ride.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/aston-2118857_640.webp\" alt=\"Aston Martin\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/aston-2118857_640.jpg\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell my<span class=\"font-weight-bold\">Aston Martin </span>DB9 GT</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Offering improved power and with crafty new touches to present its well recognised seductive design, the DB9 GT is the extreme incarnation, the embodiment of error-free form and formidable function, the beating heart of the company itself, Aston Martin.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell my<span class=\"font-weight-bold\">Aston Martin </span>Lagonda</h2>\r\n<p class=\"font-mons text-center text-white py-4\">The Aston Martin Lagonda is a tailored product programme for a new ultimate saloon which we will see the restoration of the historic Lagonda nameplate in a limited series that is strict. The Lagonda badge will proudly occupy a luxurious and exceptional super saloon once again. The beautiful luxury super saloon restores the Lagonda ethos of &lsquo;the finest of fast cars.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Aston Martin: UAE Evaluation (Under 20 Minutes)', NULL, 'Want to sell your car? Sell your Aston Martin to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:21:22', '2019-04-15 11:17:07'),
(16, 'Audi', 'audi', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Audi</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Audi</span></h2>\r\n</div>\r\n<div class=\"col-12 text-center\">\r\n<p>Just as the Audi logo has rings interlinked to each other, so are their cars interlinked with an assurance of quality and outstanding performance. Owning this German machine is one of the greatest experiences that with no doubt gives you value for your money. If you anticipate selling your Audi for whichever reason then Expat Buyers is just the buyer you&rsquo;re looking for.</p>\r\n<p>At Expat Buyers, we will not only offer you the best value for your Audi but also a competitive price in the market based on the condition of your vehicle. Bearing in mind the importance of just knowing the value, Expat Buyers are always at your service to help you know the value of your Audi, even if selling your Audi is not a priority. You can evaluate the value of your car by filling our online evaluation tool and get a value from our qualified experts with no obligation. So don&rsquo;t wait, get to know your Audi&rsquo;s value today!</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>We also recognize that time is a vital factor when you&rsquo;re in need of selling your Audi. That is why Expat Buyers offer you the easiest way of selling your car at the most competitive price market and without the effort of even advertising. If interested in selling it to us, all you have to do is book an appointment with us online or by contacting us and we will schedule a time best fit and convenient for you to come with your car together with all the required valid documentations to our office for a full inspection in order to get the accurate value of your car. If comfortable with the value and price that we offer you, we will get your Audi sold in less than just 30 minutes. We will also give you assistance where necessary in the selling process to ensure a swift customer service and immediate payment.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/audi_PNG1771.webp\" alt=\"Audi\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/audi_PNG1771.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p class=\"font-mons text-white py-2\">Audi is a major German brand that has been around since 1909. With their tendency to advance through technology, Audi has always managed to stay one step ahead in technological quality. Their A-Series is a representation of their pioneering revolution in technology. From the city cars to the sporty cars they produce today, Audi continues to maintain their stand on technological advancement on every car not to mention the mind blowing perfection on the line that distinguishes power and efficiency. This is the reason why choosing and Audi never goes wrong.</p>\r\n<p class=\"font-mons text-white py-2\">In as much as circumstances come your way and bring about change that you opt to upgrade, downgrade or sell you Audi, Expat Buyers will always offer you advice and the fairest if not most competitive market price that you will find for your car. Choose to sell your car hassle free to Expat Buyers and get your money quicker than you imagined. Let us give your Audi a new home and offer you a new one if it&rsquo;s your priority.</p>\r\n<p class=\"font-mons text-white py-2\">Contact us today or visit our offices and get the value of your Audi if not the best and fairest deal in town.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Audi | Get Your Audi Evaluated in UAE', NULL, 'Want to sell your Audi? Sell your Audi to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:59:23', '2019-03-05 07:02:03'),
