(18, 'Bentley', 'bentley', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Bentley</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Bentley</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 30px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>A marketer of SUV&rsquo;s and luxury cars, Bentley is a British automobile maker that was established as Bentley Motors Limited. As the target of the company to explore the extraordinary, Bentley has provided series of rides to this claim with top engineering as attachment to the features. A series of mergers and acquisitions was followed by the coming together and splitting of Bentley and Rolls-Royce.</p>\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Bentley</span> Arnage</h3>\r\n<p>Manufactured by Bentley Motors in Crewe, England from the year 1998 to 2009, the Bentley Arnage was introduced alongside a Rolls-Royce ride - the Silver Seraph, in the spring of 1998. Bentley Arnage and the Silver Seraph were the first totally new designs for the two marques since the year 1980. A BMW V8 engine is to power the new Arnage and the Seraph was to be powered by a BMW V12 engine. The new Arnage is to run with Cosworth-engineered twin-turbo installation.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/car-937414_640.webp\" alt=\"Acura\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/car-937414_640.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My<span class=\"font-weight-bold\"> Bentley </span>Continental GT</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Manufactured by the British automaker Bentley Motors since the year 2003, the Bentley Continental GT was the first car released by Bentley after the acquisition of the company under Volkswagen AG-management in the year 1998. The luxurious ride has made the company into a major global brand.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Bentley</span> Brooklands</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">The name Brooklands depicts two different models manufactured by the company. The first Brooklands that was produced and launched in 1992 featured a full-size capacity, and this ride was aimed to fill the space for the Bentley Mulsanne. Bentley Brooklands was named after the Brooklands banked race track getting some of its top triumphs in Surrey.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My<span class=\"font-weight-bold\"> Bentley </span>Azure</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Being a product of Bentley Motors Limited at its factory in Crewe, England, the ride was designed to feature a four seater convertible built. A significantly updated engine was used to power the new version of Bentley Azure.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Bentley | Get Your Bentley Evaluated in UAE', NULL, 'Want to sell your Bently? Sell your bently to ExpatCarBuyers. We purchase all makes and models. Get your Bently evaluated under 25 minutes in UAE.', '2020-10-01 10:16:20', '2019-04-04 17:07:20'),
(19, 'BMW', 'bmw', 1, '<div class=\"subpages-content\">\n<div class=\"container-fluid \">\n<div class=\"row top_bg whycell theme-bg mb-3\">\n<div class=\"col-md-12 text-center\">\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">BMW</h2>\n</div>\n</div>\n</div>\n<section class=\"py-5\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-12\">\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">BMW</span></h2>\n</div>\n</div>\n</div>\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-lg-6\">\n<div class=\"why-left-sec\">\n<p>Are you looking forward to selling your BMW cars instantly for cash value, look no further, you are a moment a way from achieving that. The age, condition and state of your BMW car is the least of our worries, all that is needed is your decision to sell.</p>\n<p>We know that sometimes getting individuals interested in purchasing your BMW cars can be quite frustrating and hectic, your model might not fall within their spec and they sometimes may not have the financial capacity to pay immediately. Regardless the BMW model you want to sell , expatcarbuyers is always interested in exchanging your cars for reasonable values instantly after a few procedures like Evaluation has taken place based on current market price.</p>\n</div>\n</div>\n<div class=\"col-lg-6 p-0\">\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/bmw-918408_640.webp\" alt=\"BMW\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/bmw-918408_640.jpg\'\"></div>\n</div>\n</div>\n</div>\n</div>\n</section>\n<div class=\"subpage-bg-section position-relative py-5\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-12\">\n<h3 class=\"text-white text-center font-weight-light\">How do you initiate the sales?</h3>\n<p class=\"font-mons text-center text-white 