(21, 'Bugatti', 'bugatti', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">bugatti</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Bugatti</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Thinking of where to sell my Bugatti here in the UAE? You have come to the right place! We, ExpatCarBuyers, is a leading partner in buying any car in any condition you could ever trust in Dubai. Our years of experience dare us to give you service of only 30 minutes and your car is exchanged with good cash. Even if you want to sell your Bugatti Chiron, count on us</p>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Known under the ownership of the German automaker, Volkswagen Group, Bugatti was originally a French car company established in the Alsace region, in 1909 by Ettore Bugatti. History has proven Buggati, and his family, are the key to success of the cars in the world of exclusive sports cars. The level of detail of Bugatti&rsquo;s automobile engineering and the artistic touch of its designs are the result of the artistic nature of Ettore&rsquo;s family. In fact, Carlo Bugatti, Ettore Bugatti&rsquo;s father, was a prominent jewelry designer and Art Nouveau furniture. But, the passing of Ettore in 1947 and his last successor, Jean Bugatti put the Bugatti&rsquo;s empire to the edge. Less than 8,000 units were successfully made before the company underwent a serious financial crisis and its ownership moved to its current owner. Now, the name of Bugatti is still associated with beautiful yet powerful racing cars. And among them, there are 3 Bugattis that are most celebrated in the industry: Bugatti Chiron (2016 &ndash; Present), Bugatti Veyron (2005 &ndash; Present), and Grand Sport Vitesse (2009 &ndash; Present).</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/bugatti-min.webp\" alt=\"Bugatti\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/bugatti-min.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Sell My Bugatti</span> Chiron</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Bugatti Chiron was first seen at the 2016 Geneva Motor Show. Chiron was designed by Achim Anscheidt as a mid-engined, two-seated sports car following its predecessor Bugatti Veyron. Its name was derived from a race car driver, Louis Chiron who held the most podiums in Bugatti cars. Chiron is outstanding for its sophisticated head-turning style even till now. The latest Chiron is supported with a two-stage turbocharging system that delivers 1,500 hp, carbon ceramic brake discs and calipers with 8 titanium pistons and greater aerodynamics for better efficiency.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\"><span class=\"theme-color font-weight-bold\">Sell My Bugatti</span> Veyron</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Bugatti Beyron was first unveiled in 2005 with the design by the Josef Kaban of the Volkswagen Group. This mid-engined sports car&rsquo;s name was derived from a track race driver, Pierre Veyron who brought its final racing success at Le Mans in 1939 with just one car and meagre resources. Veyron&rsquo;s most applauded was its 8L engine with its 4 turbochargers that delivered 1,001 hp and a top speed of 253 mph. And the same car, 2005 Bugatti Veyron became Top Gear&rsquo;s Car of the Decade (2000-2009).</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Sell My Bugatti</span> Grand Sport Vitesse</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Grand Sport Vitesse was first produced in 2009, and had its other version coming out with a brighter color in 2012. Grand Sport Vitesse was claimed as the fastest car in the world with its quad-turbocharged 8L W16 engine. However, without its hard top, the speed underwent a decrease to 229 mph from 253 mph. The lack of standard roof makes it need a support of adjusted windshields and also running lights with two removable tops. As all expected, the car is also one of the most expensive ever.</p>\r\n<p class=\"font-mons text-center text-white\">Which Bugatti car do you want sell? Come to one of our locations, meet our trained staff, and be proud of the amount you are getting from <strong>selling your Bugatti in Dubai</strong>. Still asking yourself &ldquo;where can I sell my Buggati?&rdquo; You should not, trust us, start from using our special online quote generator now!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Bugatti | Get Your Bugatti Evaluated in UAE', NULL, 'Want to sell your Bugatti? Sell your Bugatti to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 08:36:45', '2019-03-05 07:03:57'),
