(24, 'Cadillac', 'cadillac', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Cadillac</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Cadillac</span></h2>\r\n</div>\r\n<div class=\"col-12\">\r\n<p>If you ever wondered about &ldquo;should I sell my Cadillac?&rdquo; or &ldquo;where can I sell my Cadillac?&rdquo;, you are very welcomed to consult with us, at ExpatCarBuyers. We are a pioneer in the car selling industry in the UAE. And for years, we help tons of people to get their cars bought at the most reasonable prices regardless their condition, year, and model. If you own a Cadillac for sale, coming to a professional like us to buy your Cadillac is your best option.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Cadillac, which is the short for the Cadillac Motor Car Division, is a division of General Motors based in the US that specializes in the selling of luxury vehicles in America and worldwide at large. They markets their cars to the United States, Canada, China, and over 34 additional markets worldwide. Just in 2017 alone, they made an impressive global sale figure of 356,467 units. Obvious to us, Cadillac is the best of the best in luxury car innovation. Behind the giant car company was Henry Leland and two former financial backers of the Ford Company, Lemuel Bowen and William Murphy. In 1902, they established this company and named it after the founding father of Detroit City, Antoine de la Mothe Cadillac and used the Detroit coat of arms as the company logo. However later, in 1909, General Motors acquired Cadillac when it has already been a familiar name as a premier luxury carmaker in the world. To get to know Cadillac better, let us explore the list of their best creations ever.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/oldtimer-1439952_640.webp\" alt=\"Cadillac\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/oldtimer-1439952_640.jpg\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Cadillac Escalade</span></h3>\r\n<p class=\"font-mons text-white py-2\">Cadillac Escalade makes a new own definition on what luxury SUVs should look like. While its first generation gained so much attention yet lacked of signature, Cadillac fixed it in the next generations, second and third, making it unique and outstanding from the competitors. Today&rsquo;s Escalade is favorite for the elite and celebrities.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Cadillac Phaeton 5859</span></h3>\r\n<p class=\"font-mons text-white py-2\">John Hampshire is the genius behind the Cadillac Phaeton 5859 design. No wonder, the design is replicated in many of Cadillac&rsquo;s cars in 2010. It&rsquo;s a classic with ageless beauty.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\"> Series 62 Convertible </span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">If there is a car that could show a celebrity status in Hollywood pretty well, it would be this Series 62 Convertible. Its bold features and huge size are loved by the wealthy, but stars like Howard Hughes and Jean Harlow were who made it popular back in the mid-1900s.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Cadillac CTS</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">While many Cadillac cars are made visually attractive, Cadillac CTS is made for both aesthetics and performance. Its latest design, CTS-V is acclaimed to be the best of all CTS models.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Eldorado Biarritz</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Not only is it expensive, but this bold, beautiful Cadillac car is also exclusive. Cadillac only produces 1320 units worldwide so now, this car is often seen in auctions with unbelievably high prices.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-center font-weight-light text-white\">The Beast/ Presidential State Vehicle</h3>\r\n<p class=\"font-mons text-white py-2\">We cannot ignore that since 1993, the US presidential state car has been a Cadillac limo. This special car is heavily armored with a tear gas cannon, rocket propelled grenades, two shotguns, oxygen tanks, and also two pints of blood in the blood group of the president.</p>\r\n<p class=\"font-mons text-white py-2\">Cadillac is great investment from the past. If you own one of the listed cars and wish to sell it fast and for a high price, auctions are not a good place to go. Let us help you sell your Cadillac Eldorado Biarritz at a decent price in respect to its exclusiveness. Our Cadillac experts will be ready to help you from the moment you use our online quote generator. Let us show you the best experience in selling your Cadillac in the UAE.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Cadillac | Get Your Cadillac Evaluated in UAE', NULL, 'Want to sell your Cadillac? Sell your Cadillac to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:24:14', '2019-03-05 07:08:18'),
