(30, 'Chrysler', 'chrysler', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Chrysler</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Chrysler</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 40px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>The Chrysler is an automobile manufacturer, a brand offering ultimate in-vehicle experience, and the sedans and minivans family brand. Having its headquarters in Auburn Hills, Michigan, Chrysler was established in the year 1925 by an individual with the name Walter Chrysler. Over the years, the Company has manufactured cars that its best to serve humanity. The Chrysler is one of the most All-American make relating with excellence.</p>\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"font-weight-bold\">Chrysler</span> 300</h3>\r\n<p>The Chrysler 300 was initially showcased at the 2003 New York Auto Show, and encompassing the design of a full-size luxury ride. As an early 2005 model year car, it sales began in the United States in April 2004. There is a common difference between the new Chrysler 300 and SR-T 8, and that is the fact that the former is designed as a high-end sedan while the latter is manufactured to be the high-performance car.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/automobile-1851299_640.webp\" alt=\"Acura\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/automobile-1851299_640.jpg\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My <span class=\"font-weight-bold\">Chrysler</span> PT Cruiser</h2>\r\n<p class=\"font-mons text-center text-white py-4\">The acronym \"PT,\" in the Chrysler PT Cruiser stands for Personal Transport. In the early 2000, the retro styled compact PT Cruiser was built, featuring a 5-door hatchback. The Chrysler PT Cruiser was originally styled by Bryan Nesbitt, with another model released in 2005. The 2005 model was improved with a four-seat convertible feature.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Pontiac</span> Crossfire</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Marketed as both coup&eacute; and roadster by Karmann of Germany for Chrysler, and featuring a 2-door sports and a rear-wheel drive.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Chrysler | Get Your Chrysler Evaluated in UAE', NULL, 'Want to sell your Chrysler? Sell your Chrysler to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:18:47', '2019-04-04 16:28:44'),
