(37, 'Dodge', 'dodge', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Dodge</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Dodge</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Perchance it is time for you to <strong>sell your Dodge</strong> and upgrade to another car or use the cash to take care of an emergency. You can get started now by letting Expat Car Buyers take control of the process so that you can get quick cash for your car.</p>\r\n<p>Whether your Dodge car is a sedan, pickup truck, hatchback or minivan, our car specialists at Expat Car Buyers can ease the process of selling your car in Dubai, Abu Dhabi and their neighboring cities irrespective of its condition or age. In the past, many customers have used our services to sell their Dodge Challenger SRT Hellcat, Dodge Regent, Dodge Challenger, Dodge Polara as well as the classic Dodge Super Bee models. You can sell your Dodge for cash too by simply contacting us now.</p>\r\nThe idea behind the production of the Dodge cars was first conceived by John Francis Dodge and his brother Horace Elgin Dodge. In 1914, the company began manufacturing cars and has never looked back till now. Notably, the management of the company has undergone changes recently.\r\n<p>If you are interested in selling your Volvo XC90, we are ready to offer you cash for your Volvo XC90.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/dodge-min.webp\" alt=\"\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/dodge-min.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">The 2015 <span class=\"font-weight-bold\">Dodge</span> Challenger SRT Hellcat</h3>\r\n<p class=\"font-mons text-white py-2\">With a top speed of 199 mph and power of 707 hp, the 2015 Dodge Challenger SRT Hellcat is undoubtedly one of the exceptional muscle cars available in the market globally today. This top performing car has brought Dodge back into the limelight as one of the industry leading automakers in the world.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">The 1968 <span class=\"font-weight-bold\">Dodge </span>Dart GT 440</h3>\r\n<p class=\"font-mons text-white py-2\">As long as vintage cars are concerned, you can hardly find many cars that are better than the 1968 Dodge Dart GTS 440. While still in production, this car was powered by a Magnum V8 engine with 375 horsepower and torque of 480 lb-ft. It could move as much as 60 mph in just 5 seconds, and this made it one of the top performers during its prime. Even today, you can still enjoy a wonderful ride around town with a preserved or restored 1968 Dodge Dart GTS 440.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">The 1970 <span class=\"theme-color font-weight-bold\">Dodge </span>Challenger T/A</h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Powered by a V8 engine that could produce 350hp, the 1970 Dodge Challenger was manufactured with a beautifully colored body and design that made it a star among its equal. As one of the few race cars of its time, this Dodge car never failed to impress wherever it was seen. It is still one of the most classic Dodge cars in use today.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell Your<span class=\"font-weight-bold\"> Dodge</span> for Cash</h3>\r\n<p class=\"font-mons text-white py-2\">Do you want to sell your Dodge car fast? Whether it is a vintage Dodge car or a newer, conventional Dodge automobile, you can sell any car to us at Expat Car Buyers. Book an appointment with us at Expat Car Buyers now to schedule when your car will be brought to us for inspection and car valuation. We will provide you with a quote, and you can cash your car within 30 minutes. Our car experts can buy any makes and models of cars; so you can always count on us as your reliable one-stop car buyer.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">What are you waiting for? Contact us now and sell your car for cash easily.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Dodge | Get Your Dodge Evaluated in UAE', NULL, 'Want to sell your Dodge? Sell your Dodge to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:39:52', '2019-02-25 12:19:48'),
