(41, 'Ferrari', 'ferrari', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Ferrari</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Ferrari</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\"><strong>Where can I sell my Ferrari</strong>, how much does it cost now? &ndash; A lot of questions could pop up in your mind when you are about to sell your Ferrari 250 GTO. Of course, with such a gem to sell, you do not want to make a mistake and end up in poor car selling transaction. Fortunately, you have us at ExpatCarBuyers now! We are number one in UAE when it comes to buying used cars especially the luxurious kind of yours. We have Ferrari experts who will help you get the best price for your car so you can walk out with a light heart and without stress of having to deal with tons of paperwork. We will assist you the best we could.</p>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Ferrari N.V is an Italian car company which specializes in producing sports cars since 1939. The history began when Enzo Ferrari formed the Scuderia Ferrari racing team in 1929 and produced its first car in 1940. But only in 1947, Ferrari is recognized as an auto company. Since its inception, Ferrari continued to shine in car racing industry and made itself a symbol of speed, luxury and wealth. Proven in 2012, its 1962 250 GTO was acclaimed as the most expensive car in history when Craig McCraw bought this model through a private transaction for US$38.1 million. A couple of years later, in 2014, Ferrari was recognized as the most powerful brand in the world by Brand Finance. Ferrari is one of the oldest automobile in the world which is still continuously participating in racing, esp. in Formula One. Not only does it make proud for its existence, but Ferrari is also the most powerful team in racing, holds the most constructors championships, and has the highest number of drivers&rsquo; championship wins. Ferrari successfully thrives even after the death of its founder and is still the most powerful sports car company in the world. As a matter of fact, the sales of Ferrari in 2018 reached 8,398 units which are possibly the highest figure throughout its history. So, <strong>selling your Ferrari</strong> is never a mistake. Here are the top 8 Ferrari cars ever made.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/ferrari-min.webp\" alt=\"Ferrari\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/ferrari-min.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<h3 class=\"text-white font-weight-light\">Sell My 1962 <span class=\"font-weight-bold\">Ferrari</span> 250 GTO</h3>\r\n<p class=\"font-mons text-white py-2\">Ferrari 250 GTO is the rarest Ferrari model with only 39 units produced between 1962 and 1964. This model is a craft of engineer Scaglietti and outstanding for ever winning 3 FIFA World Championships in consecutive years.</p>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Ferrari</span> 330 P4 Berlinetta</h3>\r\n<p class=\"font-mons text-white py-2\">Ferrari 330 P4 Berlinetta is the most iconic ever. Built to beat the Ford GT40 at Le Mans in 1967. It came out true with a sensational win it made.</p>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Ferrari</span> 275 GTB</h3>\r\n<p class=\"font-mons text-white py-2\">Ferrari 275 GTB is the upgrade version of the Berlinetta series of GT Range. It wins many hearts with its luxurious look and powerful performance.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My 2013 <span class=\"theme-color font-weight-bold\">Ferrari</span> Berlinetta</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Ferrari Berlinetta has a stylish look of Ferrari 275 and 250 GT with better aerodynamic proportions.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My 1957<span class=\"font-weight-bold\"> Ferrari</span> 250 GT California</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Ferrari 250 GT California from 1957 gained the highest level of popularity among the elites. It is considered the most attractive supercar by Ferrari enthusiasts.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Ferrari | Get Your Ferrari Evaluated in UAE', NULL, 'Want to sell your Ferrari? Sell your Ferrari to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 08:41:36', '2019-08-28 17:33:04'),
(42, 'Fiat', 'fiat', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Fiat</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Fiat</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<p>Fiat is currently owned by the same company producing Chrysler cars. Fiat cars are popular for their low emissions and fuel efficiency. These Italian cars come in different models that are all well sought-after.</p>\r\n<p>Perchance you want to replace your Fiat car or need cash for your fiat car; you can sell your Fiat car to us quickly and seamlessly now. Give us a call today, and we will buy your car fast.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\"> Fiat</span> 500</h3>\r\n<p>Though Fiat 500 has undergone multiple changes over the years, the car still retains its alluring and stylish look as well as its affordability. Pop, Pop Star, Lounge and S are the trims of the Fiat 500, and the 0.9L Twinair engine with 105hp is featured in most of them. Latest versions of the Fiat 500 have a six-speaker sound system, seven airbags, leather-trimmed steering wheel, LED headlights, rear parking sensors, and 15-inch allow wheels.</p>\r\n<p>Sell your Fiat 500 today by simply calling us at Expat Car Buyers.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/fiat-500-2716838_640.webp\" alt=\"Fiat\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/fiat-500-2716838_640.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Fiat</span> Linea</h3>\r\n<p class=\"font-mons text-white py-2\">Fiat Linea was introduced as the successor of the Fiat Marea and has proven to be a road-worthy automobile. It is a small family, 4-door sedan with 5-speed dualogic semiautomatic or 6-speed manual transmission options. GPS, Microsoft Windows mobile-based system with speech function and multilingual voice recognition, and built-in USB port are some of the basic features of the Fiat Linea.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">Contact us at Expat Car Buyers whenever you are planning to sell your Fiat Linea.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Fiat</span> 500X</h3>\r\n<p class=\"font-mons text-white py-2\">Fiat 500X is a crossover, front-drive car with a turbocharged 1.4L engine. This engine can deliver 160 horsepower with an impressive 184 lb-feet of torque. Its 6-speed manual transmission and 16-inch steel wheels ensure that driving this car is an unforgettable experience. Other features you can find in the Fiat 500X are touch-screen dashboard interface, manual gearbox, and ergonomic seats.</p>\r\n<p class=\"font-mons text-white py-2\">Expat Car Buyers can provide you with a competitive quote and first-class offer when you are ready to sell your Fiat 500X</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Fiat </span> Fiorino</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Fiat Fiorino is the smallest van ever produced by this Italian automobile manufacturer till date. This compact vehicle is adequately powered by a 1.3L Multijet engine which is economical. Despite being just 3.8 meters in length, Fiat Fiorino surprisingly has enough cabin for its passengers. The fantastic features of this car are an anti-braking system, seat height adjustment, lumbar support, and a 5-inch touch-screen Satnav.</p>\r\n<p class=\"text-center\">At Expat Car Buyers, we are always ready to attend to you if you want to sell your Fiat Fiorino in Dubai and other emirates in UAE.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Fiat </span>Car in Dubai and Abu Dhabi</h3>\r\n<p class=\"font-mons text-white py-2\">To sell your Fiat car in Dubai, Abu Dhabi and other Emirates, contact us at Expat Car Buyers. Once you have booked an appointment with us, our experts will have an inspection and car evaluation to determine how much your Fiat car is worth. All things being equal, we will provide you a reasonable quote and offer cash for your car in less than 30 minutes if you accept our quote. You can always count on our car experts at Expat Car Buyers to sell your Fiat cars irrespective of its conditions or market value.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My FIAT | Get Your FIAT Evaluated in UAE', NULL, 'Want to sell your FIAT? Sell your FIAT to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:03:07', '2019-03-05 07:10:51'),
