(53, 'Hyundai', 'hyundai', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Hyundai</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Hyundai</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Has your quest to <strong>sell your Hyundai</strong> being futile? Have you been having issues with selling your car easily at a relatively good price? If yes, you must have gone through a lot, but your problems are over.</p>\r\n<p>At Expat Car Buyers, we are experts at buying cars, and we assure that you that you will get the best quote if you deal with us to <strong>sell your car for cash</strong>. Our car specialists will make sure that we buy your Hyundai without allowing you to encounter any stress or challenges.</p>\r\n<p>Since its establishment in South Korean 1967, Hyundai Motor Group has been supplying great automobiles to different continents. The company is now known as the third largest automobile manufacturer in the world as it manufactures as much as 1.6 million units of cars each year. Some of the popular Hyundai cars that have graced the automobile world include:</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/hyundai_PNG11243.webp\" alt=\"Hyundai\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/hyundai_PNG11243.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Hyundai </span> Accent</h3>\r\n<p class=\"font-mons text-white py-2\">Although Hyundai Accent was first produced in 1994, its production continues till today. Otherwise called Hyundai Verna by South Koreans, this car has been competing with several luxury cars from other automakers for several years. Due to their affordability, fuel efficiency, performance and aesthetics, the newer generations of the Hyundai Accent are highly favored by many car enthusiasts.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Hyundai </span>Tucson</h3>\r\n<p class=\"font-mons text-white py-2\">First produced in 2004, The Hyundai Tucson is a compact crossover SUV which has undergone several modifications in the past years. Currently, the Hyundai Tucson is on its third generation which was produced in 2017. The 2017 Tucson is one of the most commonly used automobiles from the Hyundai brand because of its state-of-the-art safety system, roomy interior, and performance.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">Hyundai </span>Sonata</h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Spacious interior, affordability, and safety have all been the hallmark of the latest generation of Hyundai Sonata. They are some of the best-selling family cars that are generally favored by many families worldwide. After it debuted in 1985 as an upgrade to Hyundai Stellar, the Hyundai Sonata was first sold majorly to South Koreans. However, recent modifications to the car in past decades have made it suitable for use in other countries globally. The 2017 Hyundai Sonata has won several recognitions because of its technologically advanced features.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">Hyundai </span>Elantra</h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Hyundai Elantra is one of the best compact cars in the market today as its fuel efficiency has given it an edge over many other compact cars. Although it falls short on power when compared to the likes of Volkswagen Golf and Honda Civic, Hyundai Elantra is a wonderful automobile that has various safety features and spacious interior. Its latest and sixth generation has received great reception in South Korea, the US, and many other countries.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell Your<span class=\"font-weight-bold\"> Hyundai</span> for Cash</h3>\r\n<p class=\"font-mons text-white py-2\">Want to <strong>sell your Hyundai online?</strong> Speak to our professional car specialists at Expat Car Buyers so that you can <strong>sell your car fast</strong> and seamlessly. Our experts will conduct a full <strong>inspection and car valuation</strong> so that we can determine the worth of your car depending on its current market value and condition.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">We will offer you a competitive quote for your Hyundai. After accepting our quote of your car, you will <strong>sell your car for cash</strong> quickly and get the payment instantly.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Hyundai | Get Your Hyundai Evaluated in UAE', NULL, 'Want to sell your Hyundai? Sell your Hyundai to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:41:42', '2019-03-05 07:13:19'),
(54, 'Infiniti', 'infiniti', 0, '\r\n<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Infiniti</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Infiniti</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Infiniti is a popular luxury car brand and a division of Nissan. Established in 1989, this brand has been privileged to produce some excellent and innovative automobiles that are available in a wide range of options. Infiniti cars are widely used in Asia, Europe, USA, and many other places.</p>\r\n<p>Do you want to sell your Infiniti car? If yes, our seasoned car buyers at Expat Car Buyers can help you. With our assistance, you can sell your Infiniti cars for cash in UAE.</p>\r\n<h2 class=\"font-weight-light py-3\">Sell My<span class=\"theme-color font-weight-bold\"> infiniti G35</span></h2>\r\n<p>This Infiniti car is an excellent car with a V6 engine and amazingly redefined chassis. Its handling and ergonomic interior are topnotch. Some of the innovative technologies featured in the Infiniti G35 include manual transmission, dual zone auto climate control, reclining rear seatbacks. You can sell your Infiniti G35 to us at Expat Car Buyers.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/infiniti.webp\" alt=\"Infiniti\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/infiniti.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My<span class=\"font-weight-bold\"> Infiniti</span> Q50</h3>\r\n<p class=\"font-mons text-white py-2\">Infiniti Q50 is a 3.7L, V6-engine car that has several variants. This Infiniti automobile produces magnificent 328 horsepower with a torque of 269lbs. This luxury car was originally designed with some features of a sports car. A few of the things to look out for in Infiniti Q50 are voice recognition, dual zone climate control and rearview monitor.</p>\r\n<p class=\"font-mons text-white py-2\">When it comes to selling your Infiniti Q50, we are always here for you.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Infiniti</span> QX70</h3>\r\n<p class=\"font-mons text-white py-2\">Infiniti QX70 is a crossover utility vehicle with great styling and exceptional power. As an all-wheel drive, this Infiniti car offers you excellent traction when you are behind the wheel. Its optimized acceleration and balanced handling make it the perfect machine to cruise around town. Also, it contains a spacious cabin that can accommodate you and your passengers comfortably.</p>\r\n<p class=\"font-mons text-white py-2\">Do you need to sell your Infiniti QX70? Get in touch with us.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Infiniti </span>G25</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">This mid-sized saloon car has style and performance that makes it a beautiful automobile that many car enthusiasts love. The Infiniti G25 has two variant - all-wheel drive and rear-wheel drive. Both of these two variants are equipped with the anti-braking system, sports suspension airbags, powerful engine, spacious cabin, sure-footed handling and lots more.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">You can count on us at Expat Car Buyers whenever you want to sell your Infiniti G25.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Infiniti </span>QX50</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Infiniti QX50 is a tech-savvy car that was made with a performance turbo engine, adaptable storage, alloy wheels, spacious cabin, and a high-quality sound system. This family car has a power-assisted functionality that makes your driving experience to be smooth and enjoyable.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">If you want to sell your Infiniti QX50, book an appointment with us at Expat Car Buyers.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Sell Your Infiniti</span> Car Online Now</h2>\r\n<p class=\"font-mons text-center text-white py-4\">If you want to sell your Infiniti car for cash, you do not have to wait any longer. All you have to do is to book an appointment with us at Expat Car Buyers so that we can schedule an inspection and car valuation. We will provide a competitive quote that is hard to reject. Our experienced team is always available to offer you cash for your Infiniti and other brands of automobiles.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Infiniti | Get Your Infiniti Evaluated in UAE', NULL, 'Want to sell your Infiniti? Sell your car to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 08:43:08', '2019-03-05 07:13:49'),
