(59, 'Jaguar', 'jaguar', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Jaguar</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Jaguar</span></h2>\r\n</div>\r\n<div class=\"col-12\">\r\n<p>ExpatCarBuyers stands by you whenever you want to sell your Jaguar car regardless of its year, model, mileage, or condition. Our big name in the world of car buying industry in UAE has meet us with thousands of car owners and enthusiasts who give their car up for so many different reasons, from changing cars to the need of cash in case of emergency. Whatever reasons that bring you to us, we are with you to make the best deal you could ever make with car of any condition. With no time consuming. No non-serious buyers. No stressful paperwork. Just us, and you have all you need to bring cash and smile home!</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Jaguar is a British automobile brand by Jaguar Land Rover founded in England in 1922. Jaguar soon became the icon of what luxurious, powerful car should look like. And, it is also true many public icons are fans of this brand, which results in it being associated with power and opulence and later transforming into a symbol of affluence. Since its first launching, Jaguar has made massive fame and solid loyal fandom. No wonder, whatever Jaguar car you wish to sell, somebody is craving for buying it. Jaguar is such good investment with its good sale value especially in the UAE. Whether you sell your Jaguar XF (2008-present), Jaguar F-Type (2013-present), Jaguar XJ (1968-present), be ready for a great amount of cash!</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/jaguar-1366978_640.webp\" alt=\"Jaguar\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/jaguar-1366978_640.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Jaguar XF Series </span></h3>\r\n<p class=\"font-mons text-white py-2\">Launched in 2008, the Jaguar XF has gained popularity ever since and becomes Jaguar&rsquo;s most award-winning car ever. Jaguar claims the XF series offering both excitement and efficiency to keep driver and passenger safe, connected, and entertained during the nice drive &ndash; which is true. 2018 Jaguar XF has an even better deal of upgrades: more power, more advanced safety systems, lane-keeping assistant, and a power-operated trunklid. All the goodness is there to sustain its eye-catching, aggressive, yet beautiful image.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Jaguar F-Type</span></h3>\r\n<p class=\"font-mons text-white py-2\">The Jaguar F-Type is a luxurious two-door, two-seater sports car produced by Jaguar since 2013. The Jaguar F-Type is meant to replace the former Jaguar XK and E-Type. Although it was initially launched as a two-door, soft top convertible, Jaguar added a two-door coupe version later. Currently, Jaguar F-Type is still in its generation but offered with various trim levels and supporting features in terms of infotainment, navigation, and safety. Despite its power, Jaguar F-Type is one of the cars in the class coming with smooth handling.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\"> Jaguar XJ Series </span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">The Jaguar XJ has been stealing attention and is called as one of the most luxurious vehicles ever since 1968. A special touch by designer Ian Callum in 2010 gives it even outstanding beauty and feline sleekness. In 2018, Jaguar has put the Jaguar XJ as the distinctive sedan with more power, InControl infotainment system, advanced driver assistance technologies, Long Wheelbase option, LED integration in the headlights and taillights, and overall more dynamic driving experience.</p>\r\n<p class=\"text-center\">Powerful Jaguar is not for everyone to tame in terms of price. Without proper maintenance and a good driving skill behind the wheel, even the most expensive car can turn into haunting problem in every road you hit. With the relatively high prices of parts in mind, sometimes you just better give it away for cash before things get worse and you have nothing to spare. Be mindful of the red signs like unusual noise, burning smell, or dysfunction in some of the entertainment features. Also, be aware of any small broken parts, dented corners, fine scratches, or any visual changes in your car. If your &lsquo;classic&rsquo; car, for instance, is just too expensive to repair, let selling your car Jaguar be an alternative.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p class=\"font-mons text-white py-2\">When you have ExpatCarBuyers with you, you have no more space for despair. Even when your Jaguar machine is not working anymore, and the powerful and opulent Jaguar of yours lost it charm already, we will buy it. When we buy it, we calculate every value it has not a single modification or model fact to miss. As we understand how you feel about losing your car in the hand of others, our goal is to make you walk out of our door with a happy feeling instead. To give up your favorite car is a hard choice so we do our best to make your every step during the selling process painless and stress free. Even our online quote generator is designed to give you the most accurate figure of how much your car is worth. As you find it good enough for a car as prestigious as Jaguar, you can anytime visit our Jaguar experts in one of our locations in UAE. Our team will buy your Jaguar in UAE and put every details such as modification and accessories into account. Expect the best price for your used-to-be-the best car from us!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Jaguar | Get Your Jaguar Evaluated in UAE', NULL, 'Want to sell your Jaguar? Sell your Jaguar to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:04:14', '2019-03-05 07:14:24'),
(60, 'Jeep', 'jeep', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Jeep</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Jeep</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<p>Since the 1930s, Jeep has been known to be the brain behind some of the oldest and most powerful off-road vehicles. All models of the vehicles that have been made by Jeep are all SUVs that can compete favorably with other SUVs from other automakers globally. If you want to sell your Jeep cars for cash fast, our highly experienced car experts at Expat Car Buyers can provide the assistance you need.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Jeep</span> Cherokee</h3>\r\n<p>The Jeep Cherokee is one of the favorite SUVs for off-roaders due to its exceptional performance and attractive designs. First made in the early 1970s, Jeep Cherokee has been modified with additions of several world-class technologies. The world of automobile welcomed the latest series of Jeep Cherokee in 2011.</p>\r\n<p>Whether you own the two-door or four-door variant of the Jeep Cherokee, you can sell your Jeep Cherokee to us at Expat Car Buyers at the best price.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/vehicle-3196981_640.webp\" alt=\"Jeep\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/vehicle-3196981_640.jpg\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Jeep Wrangler</span></h3>\r\n<p class=\"font-mons text-white py-2\">The Jeep Wrangler is a compact SUV with a four-wheel drive system specifically designed to give drivers total control when they are driving in the city or off-road. The generations of this popular SUV include YJ, TJ, LJ, JK, J8, and KJ. The KJ generation of the Jeep Wrangler, which is the most recent version, is powered by a 3.8L, V6 engine. It has two options &ndash; a six-speed manual transmission and a four-speed ultra drive automatic transmission.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">If you are ready to sell your Jeep Wrangler, we are ready to buy it in just a few minutes.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Jeep Grand Cherokee</span></h3>\r\n<p class=\"font-mons text-white py-2\">Unveiled in Detroit in 1992, the Jeep Grand Cherokee is a four-door, mid-size sports utility vehicle. This SUV is available in rear-wheel drive and four-wheel drive systems. It has impressive five-spoke alloy Ultra star wheels, powerful 46RE transmission, leather door systems, and several other amazing features.</p>\r\n<p class=\"font-mons text-white py-2\">You should never be stranded whenever you want to sell your Jeep Grand Cherokee for cash in UAE because our skilled car experts are here to help you.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Jeep Commander</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">The Jeep Commander is a full-size SUV that can be used as a family vehicle. With its three-row seating arrangement, the Jeep Commander can comfortably accommodate seven passengers. It is an all-wheel-drive car with a V6 engine in its original production. However, the upgraded versions were produced with 5.7L Hemi V8 or 4.7L V8 engine. Although this SUV debuted in 2006, its production stopped in 2010.</p>\r\n<p class=\"text-center\">Whenever you want to sell your Jeep Commander, we are the best buyers you can rely on for the most profitable offers.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Cash My <span class=\"font-weight-bold\">Jeep </span>Car in Dubai and Abu Dhabi</h3>\r\n<p class=\"font-mons text-white py-2\">Are you in need of where you can cash your Jeep car in Dubai, Abu Dhabi and other places in the United Arabic Emirates? Do not worry over this; contact us at Expat Car Buyers now and sell your Jeep car easily. Regardless of the models, conditions, and values of your car, our experts will offer you an appointment as well as conduct an inspection and car valuation. If you accept our quote, you will sell your car immediately.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Jeep | Get Your Jeep Evaluated in UAE', NULL, 'Want to sell your Jeep? Sell your Jeep to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:59:47', '2019-03-05 07:14:50'),
(63, 'Kia', 'kia', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Kia</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Kia</span></h2>\r\n</div>\r\n<div class=\"col-12 text-center\">\r\n<p>What is the most effortless, efficient way to <strong>sell my Kia?</strong> You will need no time till you find out ExpatCarBuyers is the answer. We are a leader in buying used Kia in the UAE. Our highly trained team of professionals have helped thousands of clients to get paid in cash for their limited edition to not functioning Kia cars on the spot. Yes, we buy your Kia cars regardless of its state, model, year, and mileage. We will make sure you have a good Kia selling experience by the time you walk out of our door! Our friendly team and comfortable location are good for Kia transactions. Worried about the paperwork? We will handle it for you.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Kia, or Kia Motor Corporation, is a South-Korean car company founded in 1944. The company is the second-largest car company in South Korea, only after Hyundai, and the fourth largest in the world. Since 2005, the company&rsquo;s ownership belongs to Hyundai with a total stake of 33.88%. Over 70 years, Kia has been evolving to be the car brand which has great reliability and fuel efficiency. In 2016, Kia was voted the most reliable. Today&rsquo;s Kia is popular not only for its performance but also its spacious layout that come at pocket friendly prices.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/kia_PNG105.webp\" alt=\"GMC\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/kia_PNG105.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Kia</span> Sportage</h3>\r\n<p class=\"font-mons text-white py-2\">Kia Sportage was first unveiled in 1993 during the Kia-Ford-Mazda alliance. Its first generation was designed based on the Mazda Bongo model in two options: 3-door convertibles or 5-door compact SUVs. Today&rsquo;s Kia Sportage has improved a lot with additions of safety technological upgrades and fantastic infotainment.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Kia</span> Sorento</h3>\r\n<p class=\"font-mons text-white py-2\">Kia Sorento was first produced in 2002 as a mid-sized SUVs based on a truck body. But today&rsquo;s Sorento has been up its game and join the tight competition with Honda Pilot, Jeep Grand Cherokee, and Ford Edge.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">Kia </span>Optima</h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Kia Optima is a Kia mid-sized 4-door sedan debuted in 2000. The Optima is sold globally under different name plates namely Kia Magentis and Kia K5. Kia Optima has its hybrid version that broke the Guiness World Record for least fuel consumption.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 text-center\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Kia</span> Rio</h3>\r\n<p class=\"font-mons text-white py-2\">Kia Rio is a Kia subcompact car debuted in 2000 as a replacement to Kia Pride and Kia Avella. Kia Rio is suitable for daily commute with its fuel efficiency and smooth drive. Besides, the Rio is also spacious for passengers and luggage. The latest generation, the 2018 Kia Rio, is featured with the Kia Drive Wise, a safety technologies to assist the driver, as well as some UVO features.</p>\r\n<p class=\"font-mons text-white py-2\">Where can I sell my Kia? If you want to sell your used Kia Optima or other models in no time without compromising its price, come to ExpatCarBuyers now. Contact us to arrange an appointment for a free inspection for your Kia. You can also use our stress free quote to check the worth of your Kia by entering your car&rsquo;s details into our online quote generator. In less than a minute, you will be presented with a price range of your Kia. With the price in your hand, you can be more confident selling your Kia in the UAE to us.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My KIA | Get Your KIA Evaluated in UAE', NULL, 'Want to sell your KIA? Sell your KIA to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:05:19', '2019-03-05 07:15:25'),
