(68, 'Lamborghini', 'lamborghini', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Lamborghini</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Lamborghini</span></h2>\r\n<p>Being a maker of luxury sport cars, SUV\'s and an Italian brand, Lamborghini is a brand with its DNA made of lines and styles. With the believe that performance is an emotion, the brand has made another impact on history being the 1st maker and winner in the same season of the Sebring 12 Hours and Daytona 24 Hours, both for the second year in a row.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 40px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Lamborghini</span> Islero</h3>\r\n<p>Lamborghini Miura, a ride named after the Miura line of bulls and a ground breaking make among cars. The mid-engined ride and gotten his name from a bull and featured many cool engineering redefining the concept of a sport car, which includes; 170mph-plus top speed and lithe, transverse-mounted V12, Ford GT40 styling,etc.</p>\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Lamborghini</span> Miura</h3>\r\n<p>According to the history of this car, it has been said that the Lamborghini Islero derived its name from a bull fight, and has been noted that Urraco-bred Miura became victorious killing a popular matador. Although the Lamborghini Islero didnt bring much sales, it brought down the maker down to an extent.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/car-160895_640.webp\" alt=\"\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/car-160895_640.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Lamborghini </span>Espada</h2>\r\n<p class=\"font-mons text-center text-white py-4\">With the soul aim of the Lamborghini to manufacture a four-seater luxurious ride, the Lamborghini Espada was built. The Lamborghini Espada has been recorded to be a top selling car, having sold up to 1227 between the years 1968 to 1978. Also, the Estoque comcept - a four-seater ride of the year 2008 was named after a matadors traditional sword, estoc.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Lamborghini</span> Jalpa</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 text-center py-4\">\r\n<p class=\"text-center\" style=\"width: 100%;\">Lamborghini Jalpa, the ultimate ride sourced its name from one of the breeds involved in bull fighting.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My<span class=\"font-weight-bold\">Lamborghini</span> Diablo</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Apart from the cool features at the back of the builders mind, an extravagant look was also added to the Lamborghini Diablo. The Lamborghini Diablo sourced its name from a fighting bull which is not popular.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Lamborghini | Get Your Lamborghini Evaluated in UAE', NULL, 'Want to sell your Lamborghini? Sell your Lamborghini to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:44:58', '2019-04-04 16:44:44'),
(70, 'Land Rover', 'land-rover', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Land Rover</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Land Rover</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Land Rover is a British car brand that deals primarily with the design and production of different models of luxury cars such as Land Rover Defender, Range Rover, Freelander, and Discovery. During their prime, each model of Land Rover cars speaks of class that can hardly be rivaled by any other automobiles around the world.</p>\r\n<p>Would you like to sell your Land Rover car today? Expat Car Buyers is always at your beck and call to help you sell your Land Rover online.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/land-rover-min.webp\" alt=\"Land Rover\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/land-rover-min.png\'\"/></div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<h2 class=\"font-weight-light py-3\">Sell My <span class=\"theme-color font-weight-bold\">Land Rover</span> Range Rover Sport</h2>\r\n<p>Range Rover Sport is typically a smaller version of most models of Range Rover SUVs. However, it is still one of the best pieces of automobiles ever produced by Land Rover. It is a high-performing SUV that has great body control and the unprecedented Dynamic Response System. This easy-to-handle luxury car has height adjustable air suspension and low-ratio gearbox.</p>\r\n<p>You can sell your Range Rover Sport online at Expat Car Buyers within just 30 minutes.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My<span class=\"font-weight-bold\"> Land Rover</span> Range Rover Velar P250</h3>\r\n<p class=\"font-mons text-white py-2\">Range Rover Velar P250 is a 4-door SUV with 4-cylinder, automatic transmission, and a gasoline-powered engine. This 4-wheel drive vehicle produces about 300 horsepower and is great for most road conditions. Some of the elements of the Range Rover Velar P250 that guarantee comfort and convenience include keyless start, keyless entry, cruise control, adjustable steering, power steering, backup camera, mirror memory, heated mirrors, and power door locks.</p>\r\n<p class=\"font-mons text-white py-2\">Are you selling your Range Rover Velar P250? Let\'s help you cash your Range Rover Velar P250 fast.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Land Rover</span> Range Rover Autobiography</h3>\r\n<p class=\"font-mons text-white py-2\">This one-of-a-kind SUV was made with a 3.0L diesel engine and 8-speed automatic transmission. Beautified with 21\" 7 split-spoke wheels and several other first-rate features, Range Rover Autobiography is the real definition of a luxury car. Pixel LED headlights, auto four-zone climate control, perforated semi-aniline leather seats, 360째 surround camera and Meridian surround sound system are just a few of the features of this car.</p>\r\n<p class=\"font-mons text-white py-2\">Perhaps you want to sell your Range Rover Autobiography; you should not hesitate to contact us at Expat Car Buyers.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Land Rover </span>Range Rover Evoque</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Range Rover Evoque is another luxury subcompact SUV from Land Rover. Like other cars within the Range Rover line of automobiles, it has an exceptionally beautiful cabin, great off-road abilities, excellent handling, and powerful 237hp turbocharged 2.0L four-cylinder engine. This 14.3 feet long car is a wonderful beast on the road.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">Are you ready to sell your Range Rover Evoque for cash? No need to look for buyers because Expat Car Buyers will offer you everything you need to sell your Land Rover car fast.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Let\'s Help You Sell Your<span class=\"font-weight-bold\"> Land Rover</span> Online</h2>\r\n<p class=\"font-mons text-center text-white py-4\">If you have any models of Land Rover that you want to sell in Dubai, Sharjah, Abu Dhabi and other Emirates in UAE, contact us quickly today and let\'s offer you a lasting solution. After we have done an inspection and car valuation and offered you a suitable quote, you can get quick cash for your Land Rover cars in less than 30 minutes.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Land Rover: Land Rover Evaluation(Under 20 Minutes)', NULL, 'Want to sell your car? Sell your Land Rover to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 08:45:07', '2019-03-05 07:16:27'),
