(72, 'Lexus', 'lexus', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Lexus</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Lexus</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<p>In September 1989, Lexus was established as a division under the popular Japanese automobile maker known as Toyota. This brand is dedicated to producing only luxury cars with the most innovative and eye-catching exterior and interior. Nowadays, there are several models of Lexus that are in the market, and each model is in a class of its own.</p>\r\nMaybe you want to sell your Lexus car, do yourself lots of good today by calling us at Expat Car Buyers. We promise to service your need quickly and courteously.</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Lexus 570</span></h3>\r\n<p>You can sell your Lexus 570 to us as it is one of the choicest cars in the market today. The Lexus 570 comes with a 5.7L V8 engine that provides a magnificent 383 horsepower and unparalleled control. Its four-wheel drive system offers unmatched performance on different terrains. Also, it has a sleek design and beautiful interior that are optimized for comfort and great performance. It comes with extra support that gives you great control and balance when behind the wheel.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/lexus_PNG69.webp\" alt=\"Lexus\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/lexus_PNG69.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Lexus GS 350</span></h3>\r\n<p class=\"font-mons text-white py-2\">The Lexus GS 350 is a sedan car whose production started in 2007. This easy-to-maintain car offers great performance and comfort. As the year progresses after its first production, Lexus has continued to add various cutting-edge features such as USB/iPod connectivity, polished interior, streaming Bluetooth audio system, and industry-leading safety elements.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">At Expat Car Buyers, we can make your desire to sell your Lexus GS 350 come to true today if you can contact us and discuss details of selling your car in Dubai.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Lexus RX 330</span></h3>\r\n<p class=\"font-mons text-white py-2\">The Lexus RX 330 is a 5-seater sedan SUV that is both reliable and comfortable. Powered by a 3L V6 engine, this Lexus car gives a 230 horsepower with 242 lbs-feet of torque and can reach 60mph in about 7.8s. A few of the features of the Lexus RX 330 that have made it one of the topmost choices of luxury cars include 17\" alloy wheels, automatic climate control, tire pressure monitoring system, a navigation system, and five-speed automatic transmission.</p>\r\n<p class=\"font-mons text-white py-2\">Looking for where to sell your Lexus RX 330? Your search is over; let our car professionals at Expat Car Buyers purchase your car fast.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Lexus ES 350</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">This is another luxury car from Lexus. Its latest version was produced in 2018 with a powerful 3.5L V6 engine. This engine is capable of delivering staggering 268hp and 248 lbs-feet of torque. It is a six-speed automatic transmission drive that suits different conditions. Its interior features a spacious cabin, panoramic sunroof, and outward visibility. Also, the Lexus ES 350 comes with a latest infotainment system that makes driving more enjoyable.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">Get an unbeatable offer from us when you are ready to sell your Lexus ES 350.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Lexus </span>for Cash in UAE</h3>\r\n<p class=\"font-mons text-white py-2\">Start the process of selling your Lexus in UAE now by simply getting in touch with us at Expat Car Buyers. Our experienced and friendly car buyers will schedule an appointment with you and then ask you to bring the car for inspection and car valuation. You can get money instantly for your car if you accept our quote.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Lexus | Get Your Lexus Evaluated in UAE', NULL, 'Want to sell your Lexus? Sell your Lexus to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:05:33', '2019-03-05 07:17:01'),
