INSERT INTO `brands` (`id`, `name`, `slug`, `top`, `discripition`, `locations`, `seo_title`, `seo_keywords`, `seo_description`, `created_at`, `updated_at`) VALUES
(75, 'Lotus', 'lotus', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Lotus</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Lotus</span></h2>\r\n</div>\r\n<div class=\"col-12 text-center\">\r\n<p><strong>Where can I sell my Lotus</strong> in the UAE? If you are no longer active in the racing field and thinking of selling your Lotus cars, listing the car on the classified markets is a big no. There, you are just likely to meet non-serious buyers who would bid your cars at irrationally low prices. So, why wasting time? We, at ExpatCarBuyers, will buy your Lotus car irrespective of its mileage, year, and model, and condition. We have our Lotus experts who will do a free inspection over your car and negotiate with you to get the most satisfying price for you. Only experts know the value of your Lotus.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Lotus is a British car company that manufactures sports and racing cars. The company was originally established as Lotus Engineering Ltd by engineers Colin Dare and Colin Chapman in 1952. The first Lotus factory was just old stables behind the Railway Hotel in Hornsey, North London. Until now, Lotus has been under several ownerships. Later after the Colins, Lotus was owned by Romano Artioli but his bankruptcy in 1996 made it acquired by Proton, a subsidiary of DRB-HICOM. And today&rsquo;s Lotus is owned by Geely (51% controlling stake) and Etika Automotive (49% stake). Lotus produces several outstanding cars namely the Europa, Esprit, Elise, Elan, Evora, and Exie sports cars. All Lotus cars share a couple of prominent characteristics: light weight and fine handling. Lotus also has its motor racing success in Formula One with Team Lotus, which was active and competitive in racing from 1958 to 1994. In 1954, Team Lotus was split off from Lotus Engineering. A few years later, in 1959, the Lotus Group of Company was formed from two subsidiaries which are Lotus Cars Limited and Lotus Components Limited.</p>\r\n<p>Lotus cars have gained fame in the sports and racing cars industry for such a long time. Let us know more about the top 3 of all Lotus cars.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/car-3959288_640.webp\" alt=\"Lotus\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/car-3959288_640.jpg\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 text-center\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Lotus Elise</span></h3>\r\n<p class=\"font-mons text-white py-2\">Lotus Elise was debuted in 1996 as a rear-wheel drive, mid-engined roadster. The car was named after Romano Artioli&rsquo;s granddaughter, Elise. By the time the Elise was launched, Artioli was the chairman of Lotus. In the Series 1, the Elise had a hand-finished fiberglass body shell covering the aluminum chassis. The shell was acclaimed to be able to minimize the cost of production and the weight of the car.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Lotus Evora</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Lotus Evora was first unveiled in 2008 at the British International Motor Show under &ldquo;Project Eagle&rdquo;. All features of the Elise are also available in the Evora. Only after 2010, the redesigned Evora was launched as Evora S. The Evora S featured supercharged 3.5L V6 engine. The next Evora models include Evora 400 and Evora GT430, all having their significant modifications from the previous generations.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 text-center\">\r\n<h3 class=\"text-white font-weight-light\">Sell My<span class=\"font-weight-bold\"> Lotus Exige</span></h3>\r\n<p class=\"font-mons text-white py-2\">Lotus Exige was debuted in 2000, modelled after the former Lotus Elise roadster. This two-seater car was powered with 1.8L Rover K-Series engine that can accelerate 177bhp. Just like the Evora, the Exige underwent several significant modifications. The most popular one is the V6-engined Lotus Exige Cup 430 that was launched in 2017.</p>\r\n<p class=\"font-mons text-white py-2\">ExpatCarBuyers buy your Lotus Elise from the Series 1 or 2017 Lotus Exige Cup 430. We will make it easy for you to get paid in cash in 30 minutes at our location. Don&rsquo;t worry about the paperwork. We will do it for you. If you are serious in selling your Lotus in the UAE, start your journey with us by checking your car value in our online quote generator here. Yes, I sell my Lotus now.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Lotus | Get Your Lotus Evaluated in UAE', NULL, 'Want to sell your Lotus? Sell your Lotus to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:07:02', '2019-03-05 08:21:02'),
