(87, 'Mitsubishi', 'mitsubishi', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Mitsubishi</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\" style=\"margin-bottom: 40px;\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Mitsubishi</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Mitsubishi is a Japanese multinational automotive manufacturer with its headquarter in Minato, Tokyo, Japan. With the slogan that \"Safety comes from man and car together,\" and being the 6th and 16th biggest producer in the Japanese Automaker and worldwide respectively, Mitsubishi has not only offered high safety, but great dependability with cool and special interior features.</p>\r\n<p>When the journey seems more satisfying than the destination, then Mitsubishi is definitely the ride. Selling your Mitsubishi might not seem too easy as it sounds, but with us, we can assure you of a 100% safe deal while still offering you the best competitive price.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/mitsubishi-evo-8-3243406_640.webp\" alt=\"Mitsubishi\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/mitsubishi-evo-8-3243406_640.jpg\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Mitsubishi </span>Lancer</h3>\r\n<p class=\"font-mons text-white py-4\">If you wish to sell your Mitsubishi Lancer in Dubai, then you\'ve got the right and best Car services, Expat car buyers. Famous for its multi use, the Mitsubishi Lancer can fit in as a business and family ride. The car was built in 1973 by Mitsubishi Motors, with its first generation referred to as the Dodge Colt. As time went by, the fourth and Eighth generation were released and referred to as Lancer Fiore and Lancer Cedia respectively. As the world of Mitsubishi kept on advancing, the latest generation was released with cool features such as all-wheel control, seven standard airbags, etc.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Mitsubishi</span> Pajero</h3>\r\n<p class=\"font-mons text-white py-4\">The Mitsubishi Pajero is also known by its popular name, Mitsuibishi Montero. The cool featured model was designed with features that have never been present on any Japanese four-wheel-vehicle at the initial time of production, 1982. Well, at the first time of production, it was the type preferred by virtually every individual due to its other exceptional features which includes: turbocharged diesel engine, wishbone suspension, torsion bar springs, power steering and suspension seats. Expectedly! Technology caught up with this model. In 1983, the model MIwas improved to a five-door resulting in the change to a long-wheel and longer seat capacity.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell my <span class=\"theme-color font-weight-bold\">Mitsubishi</span> ASX</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Now, you can sell your used Mitsubishi ASX right here in Dubai. Talking about the integrated technology of smart design for owning the city, the Mitsubishi ASX offers a greater safety and the future cool features to the present car. The Mitsubishi ASX encompasses features which includes: Blind Spot Warning, Lane Change Assist, Lane Departure Warning, Automatic High Beam, Forward Collision Mitigation, Active Stability Control, etc.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell my <span class=\"theme-color font-weight-bold\">Mitsubishi</span> Mirage</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Explore your world with the non-hybrid and most fuel-efficient Car in UAE. Designed with thousands of nice features, the Mitsubishi Mirage was produced in the year 1978 to 2003 and then, 2012 with superb features which includes: heated front seats, auto A/C, HID headlamps, fog lamps, FAST-Key to enjoy any adventure in Dubai, UAE.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell my <span class=\"font-weight-bold\">Mitsubishi </span> Attrage</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Perfectly made for you! The Mitsubishi Attrage car is the everyday car with its special attractivity right here in Dubai, UAE. Styled to be more fuel-efficient while giving a pleasurable ride, the Mitsubishi Attrage is designed with the body shape that reduces drag when moved through the air, fuel-efficient 1.2L MIVEC engine, and lots more for your best ride experience in Dubai, UAE.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Mitsubishi | Get Your Mitsubishi Evaluated in UAE', NULL, 'Want to sell your Mitsubishi? Sell your Mitsubishi to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 11:02:56', '2019-03-05 08:29:52'),
