(95, 'Peugeot', 'peugeot', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Peugeot</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Peugeot</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">3 EFFICIENT <span class=\"theme-color font-weight-bold\">PEUGEOT</span> CARS</h3>\r\n<p>The Peugeot brand was established by Jean Pierre and Jean Frederic Peugeot, both Frenchmen, in 1810 and over the years, it has made quite a name for itself in the automobile industry as being a producer of reliable and durable vehicles. Peugeot is a part of the Group PSA which consists of other well-known companies that have been attributed with the manufacture of strong vehicles and motorcycles like Citro&euml;n, DS, Opel, and Vauxhall. Their automobiles have proven to be roadworthy both on race tracks and roads. Here are some of Peugeot\'s most efficient cars in UAE.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/car-3051027_640.webp\" alt=\"Peugeot\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/car-3051027_640.jpg\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Peugeot </span>308</h3>\r\n<p class=\"font-mons text-white py-2\">This car was originally designed by Stephan Pereux as a replacement for the Peugeot 307 model. It is the first of the X308 Peugeot series and it was launched in 2007. The previously small family car was redesigned and refurbished and now, it has evolved into a fuel efficient and spacious automobile. It constantly adopts new technological improvements to satisfy its ever growing clientele. In 2014, the Peugeot 308 climbed ranks and beat the BMW i3 and even the Tesla Model S and won the European Car of the Year title for its 2013 model. The 2017 Peugeot 308 comes with a new front bumper and bonnet and a new grille design that bears the Peugeot brand logo. Every 308 model has an updated central touchscreen which boasts of the TomTom satellite navigation system and apart from the Active and GTi models, every model now comes with a Panoramic roof. The engine power has also been taken up a notch and it now sports the 1.5HDi engine which produces 130bhp.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">Peugeot</span> Partner</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">If you remember the Citroen Berlingo, you would notice the similarities between it and the Peugeot Partner; they are very identical. This automobile is a reasonably strong and compact van that can be compared with a Ford Transit Connect, Fiat Doblo or VW Caddy. The Peugeot Partner was given a facelift and refitted with a new, better engine in 2015. The 2018 version strongly resembles the Peugeot Rifter MPV and it is bigger, more squarish and this makes it different from the Citroen Berlingo. The new design used for this version makes it appear very much alike as the Peugeot 2008 and3008. In addition to the noticeable change in the exterior\'s design, it also has more cargo load capacity and can comfortably carry a load of 650kg-1 tonne.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Peugeot </span>208</h3>\r\n<p class=\"font-mons text-white py-2\">This model was designed to replace the Peugeot 207 model and it was officially launched at the Geneva Motor Show in 2012. The very first model of the Peugeot 208was a hatchback with 3 doors but in 2012, 2 extra doors were added y, making it a 5 door hatched vehicle. This year\'s version, the 2018 Peugeot 208 has been given a new look; the angles are now sharper and the whole exterior looks sophisticated. It has also been fitted with new technology like the park assist feature, the active city brakes, the reverse camera and so on. The vehicle is also connected to a 3D navigation system.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Peugeot | Get Your Peugeot Evaluated in UAE', NULL, 'Want to sell your Peugeot? Sell your Peugeot to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:09:00', '2019-03-05 08:35:04'),
(97, 'Pontiac', 'pontiac', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Pontiac</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Pontiac</span></h2>\r\n<p>The Product used to be a car which was manufactured, sold, and owned by General Motors until nPontiac overtook Oakland and succeed the brand totally in 1993. Pontiac was launch as a buddy product for General Motor&rsquo;s more costly row of Oakland Vehicles.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 40px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"font-weight-bold\">Pontiac</span> GTO</h3>\r\n<p>The Pontiac GTO was originally built and manufactured in 1964 &ndash; 1974 by the Pontiac division of GM. The first set or first generation of this model was in between the year 1960 and 1970 and designed as a muscle car. The Pontiac GTO has been noted for starting the trend with all four domestic cars.</p>\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"font-weight-bold\">Pontiac</span> Aztek</h3>\r\n<p>Marketed from the 2001 &ndash; 2005 year model, the Pontiac Aztek is an average crossover ride with four doors, a four-wheel drive and a front engine. The Pontiac Aztek is a good family size car with cool features to support personal preferences.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/pontiac-207443_640.webp\" alt=\"Pontiac\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/pontiac-207443_640.jpg\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Pontiac</span> Vibe</h2>\r\n<p class=\"font-mons text-center text-white py-4\">The Pontiac Vibe is a luxurious ride with a compact hatchback design. The Pontiac Vibe was fully furnished with help coming from two automobile manufacturers; the General Motors and the Toyota. Also, the Pontiac Vibe is a comfortable and nice looking family size car.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Pontiac</span> Grand Am</h2>\r\n<p class=\"font-mons text-center text-white py-4\">The Pontiac Vibe is a luxurious ride with a compact hatchback design. The Pontiac Vibe was fully furnished with help coming from two automobile manufacturers; the General Motors and the Toyota. Also, the Pontiac Vibe is a comfortable and nice looking family size car.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Pontiac | Get Your Pontiac Evaluated in UAE', NULL, 'Want to sell your Pontiac? Sell your Pontiac to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:49:30', '2019-04-04 16:19:25'),
(98, 'Porsche', 'porsche', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Porsche</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Porsche</span></h2>\r\n</div>\r\n<div class=\"col-12 text-center\">\r\n<p>Is selling your Porsche in the least time possible and the best market value what you&rsquo;re looking for? Well Expat Buyers may be just what you seek, but first, we&rsquo;ll begin by acknowledging this German prestigious brand to be a beauty because of its designs but at the same time a beast when the rubber touches the tarmac. This is all due to the rich experience in car manufacturing that stretches up to the 19th century. Porsche produced cars from the period of the electric cars in 1898 and also produced several cars during World War II. One of their historically most exceptional sports car that was manufactured not long after the World War II was the Porsche 64. Up to this day, Porsche vehicles are still exceptional, that is why they customers who own Porsche often, if not always, own more than one Porsche model in their collection of cars.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>However, there still comes a time when change is inevitable or as some may say &lsquo;necessary&rsquo;, when selling your Porsche becomes a priority. Despite the condition, you can still sell your Porsche for a market competitive price. At Expat Buyers, we will offer you with the best valuation for your Porsche Cayenne, Boxster, 900 series or whichever model and offer you a good price. Instead of going through the tiring hassle of privately selling your car to individuals who only seek to bargain below the actual value of your Porsche, come to Expat buyers and get yourself the most competitive price for your car.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/porsche_PNG10629.webp\" alt=\"Porsche\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/porsche_PNG10629.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p class=\"font-mons text-white py-2\">We provide the easiest, effective and safest way for you to sell and get your payment immediately. If interested in selling your Porsche to Expat Buyers, you can contact us to guide you through the process or you could secure yourself an appointment during the most favorable time for you to visit our office. We will expect you to come with the Porsche you want to sell accompanied with all the necessary documentation for us to conduct a detailed evaluation in order to get the value of the car on the basis of the current market value and the condition of the car. After this, our team will not only offer you a fair and competitive price in which you intend to sell your Porsche but will also assist you with the selling process for you to receive you payment in not more than 30 minutes should you be comfortable with the offer.</p>\r\n<p class=\"font-mons text-white py-2\">At Expat Buyers, we understand the importance of knowing the value of your Porsche and the fact that selling your Porsche may not always necessarily be your immediate priority; however still, we are glad to always help you know the value in which you can sell your Porsche as the information itself is useful in its own sense. In this consideration, you can therefore use our online tool which through our professional and qualified experts you will receive an obligation free valuation of your Porsche.</p>\r\n<p class=\"font-mons text-white py-2\">Contact us today for any inquiries or come to our office and let us buy or help you sell your car. Moreover, feel free to use our valuation tool online and get to sell your Porsche today!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Porsche | Get Your Porsche Evaluated in UAE', NULL, 'Want to sell your Porsche? Sell your Porsche to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:11:06', '2019-03-05 08:36:10'),
