(102, 'Renault', 'renault', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Renault</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Renault</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>The Groupe Renault is the French group that produces different Renault vans and cars. This multinational group was instituted by the Renault siblings, Louis Renault, Fernand Renault, and Marcel Renault. By producing simple, eye-catching and reliable Renault cars, the Groupe Renault has captured the heart of many faithful car lovers. With the improvement in their designs and production, Renault cars are now seen as some of the best and most innovative cars.</p>\r\n<p>Perhaps you have a Renault car that you are currently thinking about selling for cash, do not hesitate to contact us at Expat Car Buyers to get the quick cash you need. We have been assisted many car owners in UAE by buying their cars, and we are ready to help you too once you get in touch with us. Here at Expat Car Buyers, we do not take advantage of the situations of our customers; therefore, we ensure that we offer each car owner great deal that will make them smile after selling their Renault cars to us.</p>\r\n<p>A few of the popular Renault cars we have bought from several customers include:</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/renault_PNG80.webp\" alt=\"Renault\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/renault_PNG80.png\'\">\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">Renault</span> Megane</h3>\r\n<p class=\"font-mons text-white py-2\">This small family car has been in production for many years in different forms including saloon, hatchback, convertibles, estate, and coupe. When it was first produced in 1995, it came with chassis and powertrain that looked like those of the previous Renault Cars. However, it has undergone various facelifts so that it can meet up with the current technological standards in the automobile industry.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">Renault </span>Duster</h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">In 2009, the first generation of Renault Duster was produced with a 1.2L petrol engine that can either be an all-wheel drive or front-wheel drive. Customers had the options of choosing between the 4-door pickup or 5-door station wagon models of this Renault car. Need to sell your Renault Duster? Expat Car Buyers will service your needs.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell Your <span class=\"font-weight-bold\">Renault </span>Car Fast</h3>\r\n<p class=\"font-mons text-white py-2\">Whenever you want to sell your Renault car fast in UAE, you do not need to look for buyers endlessly online or offline. By just contacting us at Expat Car Buyers, you have already started the process of selling your car as our experienced and skilled car buyers will ensure you do not have to wait for long to get cash for your Renault car.</p>\r\n<p class=\"font-mons text-white py-2\">From Captur to Grand Scenic, Scenic, Clio, Laguna, Grand Escape, Duster, Twizy, Megane, Twingo, and many other models, we can buy any models of Renault in UAE in just 30 minutes.</p>\r\n<p class=\"font-mons text-white py-2\">You can start the process of selling your Renault car now by booking an appointment with us online or at our office. You will be required to bring your car to us for a free inspection. Using the current market price and condition of your car, we will provide you with a quote that is highly competitive. If an agreement is reached on the quote, we promise to provide you quick cash for your Renault car in less than 30 minutes.</p>\r\n<p class=\"font-mons text-white py-2\">Do not leave the sales of your Renault car in the hands of inexperienced and dubious car buyers, speak to our experts at Expat Car Buyers today to get cash for your car.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Renault | Get Your Renault Evaluated in UAE', NULL, 'Want to sell your Renault? Sell your Renault to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:31:44', '2019-03-05 08:37:21'),
(103, 'Rolls Royce', 'rolls-royce', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Rolls-Royce</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Rolls-Royce</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 30px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>Being a brand that exceed others in quality and rank, Rolls Royce is an automobile company centered on world-class power, producing timeless appealing rides, established in the year 1904 and founded by Charles Rolls and Henry Royce. Apart from bearing the title of being the best car in the world at the time, the company has produced rides with high class engineering to suit top personal taste.</p>\r\n<h3 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\"> Rolls-Royce </span>Phantom</h3>\r\n<p>Produced by the Rolls Royce motor cars in the United Kingdom, the Rolls Royce Phantom is luxury ride introduced in 2003 and winning the Top gear car award for that year. Other models related to this include the Rolls-Royce Phantom Drophead Coup&eacute;, the Rolls-Royce Phantom Coup&eacute;, Rolls Royce Phantom III, Rolls Royce Phantom II, Rolls Royce Phantom I, Rolls Royce and Phantom V.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/traffic-3062610_640.webp\" alt=\"Acura\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/traffic-3062610_640.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My<span class=\"font-weight-bold\"> Rolls-Royce </span>Silver Shadow</h2>\r\n<p class=\"font-mons text-center text-white py-4\">As a product of the Great Britain, the Rolls-Royce Silver Shadow offers a top feature using the monocoque chassis. This ride was manufactured succeeding the concern that the automobile company was lagging behind in innovation. Other models related to this include the Rolls-Royce Silver Ghost, Rolls-Royce Silver Wraith, Rolls-Royce Silver Cloud, Rolls-Royce Silver Seraph and Rolls-Royce Silver Spirit.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Rolls-Royce </span> Twenty</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Referred to as the company\'s \"small car\" for the 1920s, the Rolls-Royce Twenty was built with the aim of attracting owner drivers and was manufactured at the same time together with the 40/50 Silver Ghost and Phantom.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell My<span class=\"font-weight-bold\"> Rolls-Royce </span>Corniche</h2>\r\n<p class=\"font-mons text-center text-white py-4\">The Rolls-Royce Corniche was produced and marketed by the Company as a two-door, five-seater ride and advancement to the Rolls-Royce Silver Shadow. With the exterior design plan idea from an individual called John Polwhele Blatchley, the model was given a final touch in London. Another type of the Rolls-Royce Corniche was produced in the UK from 2000 - 2002, and was the most costly car from Rolls-Royce at the time of its release.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Rolls Royce | Get Your Rolls Royce Evaluated in UAE', NULL, 'Want to sell your Rolls Royce? Sell your car to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:56:58', '2019-04-04 17:16:12'),
