(111, 'Subaru', 'subaru', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Subaru</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Subaru</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<p>Subaru is a Japanese automobile manufacturer that first started productions for the Asian market. Nevertheless, it increased its reach to North America and other places by the 1970s and 1980s with Subaru Outback, Subaru Forester, and other models.</p>\r\n<p style=\"width: 100%;\">At Expat Car Buyers, we are into buying Subaru cars of different models. So if you would like to sell your Subaru car in Dubai and Abu Dhabi, we can help you.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Subaru Forester</span></h3>\r\n<p>Subaru Forester was first introduced in 1997 as an all-wheel-drive station wagon. Over the years, many trims and engines have been produced with this model, and all have been good cars for their users. Excellent audio system, satellite navigation system, roof rack, and fog lights are a few of the features of the latest trim of the Subaru Forester.</p>\r\n<p>Let\'s offer you the best deal whenever you want to sell your Subaru Forester for cash in UAE.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/subaru-impreza-2927400_640.webp\" alt=\"Subaru\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/subaru-impreza-2927400_640.jpg\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Subaru Impreza WRX STI</span></h3>\r\n<p class=\"font-mons text-white py-2\">This beautiful and functional car is from the lines of Subaru Impreza. It features a six-speed manual transmission and turbocharged 2.5L engine with 305hp and 290 lb-feet of torque. The Subaru Impreza WRX STI can reach 60mph in just 5.7s. There are innumerable features that make this car a great choice for anyone.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">Use our service today to sell your Subaru Impreza WRX STI as soon as you want.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Subaru XV Crosstrek</span></h3>\r\n<p class=\"font-mons text-white py-2\">Subaru XV Crosstrek is an SUV with a 2.0L engine that delivers 148hp. This Subaru car is dependable both on and off the road, and has features such as top-quality audio system, hands-free phone connectivity, and voice activated navigation system. When it comes to compact SUV, Subaru XV Crosstrek is one of the best for different terrains.</p>\r\n<p class=\"font-mons text-white py-2\">Need to sell your Subaru XV Crosstrek? Take the right step today by contacting us at Expat Car Buyers.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Subaru BRZ</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">Subaru BRZ is another nice car that was made with a 205hp, 2.0L engine. It is a rear-drive sports car that features a six-speed automatic transmission. Although it has small trunk space and backspace, it makes up for this lack with its great handling, control, and innovative features.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">Use our service at Expat Car Buyers to sell your Subaru BRZ online at the best price.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Subaru Outback</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">The first sets of Subaru Outback were produced in the mid-1990s as station wagons with basic elements of SUVs. This all-wheel drive is a reliable, rugged and excellent car, and its current generations are equipped with state-of-the-art features associated with modern cars. Subaru Outback offers unsurpassed multi-terrain handling.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">Do not hesitate to call us at Expat Car Buyers if you ever want to sell your Subaru Outback.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Subaru </span>in Dubai</h3>\r\n<p class=\"font-mons text-white py-2\">Are you thinking about selling your Subaru car in Dubai, Abu Dhabi, and other Emirates now? We are available 24/7 to service your needs. Our car experts will provide you a good quote for your car after inspection and car evaluation. If you accept our quote, you can get cash for your Subaru car immediately.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Subaru | Get Your Subaru Evaluated in UAE', NULL, 'Want to sell your Subaru? Sell your Subaru to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:16:06', '2019-03-05 08:44:35'),
(112, 'Suzuki', 'suzuki', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Suzuki</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Suzuki</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">3 <span class=\"theme-color font-weight-bold\"> SUZUKIS</span> THAT ARE VALUE FOR MONEY</h3>\r\n<p>One company that deals majorly in the production of automobiles, marine engines, small internal combination engines, etc is the multinational corporation based in Japan; Suzuki Kabushiki Kaisha. This company was founded by Michio Suzuki in 1909 and since then, it has been on a steady climb to success and the fact that they produce some of the toughest cars available in the market of present is well known. In 2014, it was ranked as the 9th largest automobile manufacturing company in the world. There are three most popular vehicles under this brand; the Grand Vitara, the Suzuki Swift and lastly, the Jimmy, these cars are worth their money\'s worth, fuel efficient, and require low maintenance.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/suzuki_PNG12311.webp\" alt=\"Suzuki\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/suzuki_PNG12311.png\'\"/></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">SUZUKI</span> GRAND VITARA</h3>\r\n<p class=\"font-mons text-white py-2\">This subcompact SUV has been around in the market for up to 30 years now, the Suzuki Grand Vitara is in its fourth generation of production and has been redesigned and remodified over the years. The first generation version of this model was a Mini SUV which carried different nameplates, the second one was a compact SUV named the Grand Vitara and the third one was a compact SUV. The fourth and last generation of presently is a subcompact crossover SUV that was introduced in the year 2015 and it carries the original Vitara nameplate. Of recent, a 2019 model of the automobile was unveiled and this model comes with a few improvements both inside and outside. It sports new alloy wheels, a new front grille, new LED taillights, and all these things have gone a long way in improving the overall outlook of the vehicle. The Suzuki Grand Vitara is powered by massive 1.0L and 1.4L turbocharged gas engines which produces 110hp and 140hp. It also comes with a four wheel drive option in the SZ-T trim level. It can boost if new technological improvements such as the lane departure warning and prevention, a blind spot monitoring system and a traffic sign recognition feature. In this new model, better materials are used on the dashboards in the interior and the exterior now had two new additional colors.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\"><span class=\"theme-color font-weight-bold\">SUZUKI</span> SWIFT</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">As of 2005, the Suzuki Swift which was produced to replace the Suzuki Cultus (which was well known for its last great performance and fuel efficiency) had garnered up to 4 million unit sales worldwide with a majority of its sales coming from India. The Suzuki Swift is a subcompact car that was first launched in 1983 and at the moment, is in its fourth generation production wise. This fourth generation has been given boosts in terms of the facelifts and trims to the lines, even with the short exterior, it is spacious on the inside. The engines have been changed and it now carries the more efficient 1.2L four cylinders DualJet petrol ending and the SZ-T trim had 1.0L Booster engine. There is another version of the Suzuki Swift which is more efficient and runs on the aforementioned Booster engine that is now paired with a small battery and motor.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\"><span class=\"font-weight-bold\">SUZUKI</span> JIMNY</h3>\r\n<p class=\"font-mons text-white py-2\">This automobile was first launched in 1970 and it is one of the early productions of the Suzuki company. It was designed just like the LJ50 but with an upgrade in form of an 800cc four-stroke in-line four-cylinder engine. Other trim levels included the Jimny 1000/SJ410 and Jimny 1300/SJ413 which was later used in the Samurai. The redesigns on this vehicles over time which includes a new sturdy chassis combined with the ALLGRIP 4X4 systems have made it one of the best vehicles to be used by off-roaders to hit the market yet. It was confirmed by Maruti Suzuki that in 2019, a new Suzuki Jimmy would be produced and it while it would retain the same wheelbase as the previous model, it would be shorter and wider and also be better equipped for off-road expeditions. Also, it would have 205mm ground clearance in the Sierra version. This new model is said to include better and modified safety features. The most looked forward to modification is the exterior of the automobile which has been compared to that of the G-wagons.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Suzuki | Get Your Suzuki Evaluated in UAE', NULL, 'Want to sell your Suzuki? Sell your Suzuki to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:09:51', '2019-03-05 08:44:55'),
