(114, 'Tesla', 'tesla', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Tesla</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<h2 class=\"text-center  font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Tesla</span></h2>\r\n<p>Wow! Tesla automobile company is speeding up the global transition to continuous energy with its manufacture of electric motor vehicles, integrated renewable energy and solar panels. Being an energy company and an American automobile manufacturer, the Company is offering groundbreaking cars and based in California.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 40px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Tesla </span>Model S</h3>\r\n<p>Perfectly! The Tesla Model S offers high impact protection. Initially, the Tesla Model S was build with the mind set of an electric car. It was finely finished, perfected with high architectural strength and a battery packed and mounted on the floor making room for a high impact protection. Also, the Tesla Model S was built with quickest acceleration at the back of the builder&rsquo;s mind. The luxurious ride meets the industrial level for safety and high-performance irrespective of the condition of the weather. Explore any location with a convenient charging option and leading range. Autopilot improved convenience and safety to give maximum assistance.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/jp-valery-1053965-unsplash.webp\" alt=\"Acura\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/jp-valery-1053965-unsplash.jpg\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\"><span class=\"font-weight-bold\">Tesla</span> Model X</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Explore some time and have the best of fun around the Tesla Model S, the safest SUV. Built with the target of being an electric car, the inbuilt features surely provide a little probability of injury to the occupant. Also featuring highly convenient interior design, containing up to seven individuals while being able to travel to any location without excluding a convenient charging option</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Tesla | Get Your Tesla Evaluated in UAE', NULL, 'Want to sell your Tesla? Sell your Tesla to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 09:51:00', '2019-04-04 16:55:05'),
(115, 'Toyota', 'toyota', 1, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Toyota</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Toyota</span></h2>\r\n</div>\r\n<div class=\"col-12\">\r\n<p class=\"text-center\">Thinking about selling your Toyota? Expat Buyers might be just the right place for you. Through our expert evaluators, we offer in person vehicle evaluations of the most accurate value in which you can sell your car. Besides knowing the value of how much you can sell your car, you may also be interested in considering the offer in which Expat Buyers may have for your car.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>We find it important that even if you&rsquo;re not really interested in changing your car any time soon, it is useful to always know the value in which you can sell your Toyota. You can evaluate the value of your Toyota using our online platform in which through the help of our experts you will be able to get an accurate valuation of your car with entirely no obligation. This might come in handy in circumstances such as part exchanges or any other situation where the value of your Toyota is required.</p>\r\n<p>It is advisable however to always sell your Toyota before it gets too weary because its value diminishes the longer you stay with it. Moreover, over you will begin spending too much money for repairs and replacements of worn out parts. Selling your Toyota for an upgrade will be an advantage as you get to save money for the repairs at the expense of a brand new car!</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/toyota_PNG1955-min.webp\" alt=\"Toyota\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/toyota_PNG1955-min.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 text-center\">\r\n<p class=\"font-mons text-white py-2\">If interested in selling your Toyota to us, you can you can book an appointment with us online or through a call and we&rsquo;ll schedule a day according to your timeline when you&rsquo;ll drive to our offices with the Toyota you want to sell for a full inspection in order to get an accurate valuation of your car based on the condition and the current market value and so as to get a rather precise but competitive price in which you can sell your Toyota. If happy with the price, we will have your cash ready for you in the least number of business days or even the same day if not less than just 30minutes! Our team will also be at your disposal to help you initiate the entire selling process.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">For the last eight decades, Toyota has been one of the most trusted car manufacturers in the world. Toyota has always given their customers a quality experience as they anticipated and sometimes even better. In fact, as it stands today it is the largest car manufacturer. Cars produced by Toyota are characterized with values such as affordability, reliability and efficiency. In their experienced and intelligent designing of car models, Toyota has always been inclusive of families (Toyota PROACE VERSO), city cars such as the Toyota Aygo, off road vehicles (Toyota Land Cruiser and FJ Cruiser), low cost models (Toyota Vitz) and several trucks as well. Some of the most successful models that have been sold are Toyota Land Cruiser, Toyota Corolla, Toyota Camry and Toyota 4Runner. You could also sell your Toyota today!</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p class=\"font-mons text-white py-2\">Evidently, Toyota is a well known brand that is ranked with quality and a vast variety of vehicle models best suited for the needs of almost every customer, and with this in mind Expat Buyers might actually be interested in you selling your Toyota to us.</p>\r\n<p class=\"font-mons text-white py-2\">Contact us for any inquiries or if interested in selling or knowing the value of your Toyota today.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Toyota | Get Your Toyota Evaluated in UAE', NULL, 'Want to sell your Toyota? Sell your Toyota to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:12:31', '2019-03-05 08:45:33'),
(118, 'Volkswagen', 'volkswagen', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Volkswagen</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\" style=\"margin-bottom: 40px;\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell My <span class=\"theme-color font-weight-bold\">Volkswagen</span></h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<p>The Volkswagen is a German brand; a German automobile company that was established by the German labour front in the year 1937. Suitable for both personal and business requirement, the reliable Volkswagen in Dubai, UAE, offers supplementary benefit with cool features to support both the number of passengers and enhance the comfort ability.</p>\r\n<p>With its headquarters in Wolfsburg, Germany, and its mission to simply be the best among other brands in every section of the business, Volkswagen has provided beyond doubt exceptional features to boost its rider&rsquo;s fun moments.</p>\r\n<h3 class=\"font-weight-light\">Sell My <span class=\"font-weight-bold\"> Volkswagen </span>Beetle</h3>\r\n<p class=\"py-2\">Also officially referred to as the Volkswagen Type 1 and introduced by Volkswagen in the year 1997, the Volkswagen Beetle is designed targeting a high suitability to a small family size in Dubai, UAE. The Volkswagen Beetle A5 was introduced in the year 2011, being the successor to its older form. Being a great preference for sun lovers, the Volkswagen Beetle is a four-seater small family sized car with a good length, width and base wheel. Do you wish to sell your Volkswagen Beetle here in Dubai, UAE? Expatcarbuyers offers you the best!</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/city-1284508_640.webp\" alt=\"Volkswagen\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/city-1284508_640.jpg\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12 text-center\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Volkswagen </span>Touareg</h3>\r\n<p class=\"font-mons text-white py-4\">Are you in need of some quick cash and want to sell your Volkswagen Touareg in Dubai, UAE? Would you prefer selling your old Volkswagen Touareg for a new ride and do not want to be a victim of bad Car services? We\'ve got some good news here at Exparcarbuyers!</p>\r\n<p class=\"font-mons text-white\">Combined with bold features and smooth curves, the Volkswagen Touareg is styled to give a sporty style that captivates most individuals attention. The Volkswagen Touareg is a mid sized sport utility vehicle manufactured in 2002.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell my <span class=\"theme-color font-weight-bold\">Volkswagen </span>Golf</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">The Volkswagen Golf is the model that buys you some time outside of the box. For a high performance in everyday life in Dubai, UAE, the Volkswagen Golf is an all-in-one specially designed ride blessed with the turbocharged tools to keep up with very fast movement. Produced by the automobile manufacturer, Volkswagen, in 1974, the ride is a small family sized car with a sleek design to suit individual taste in Dubai, UAE</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center  font-weight-light\">Sell my <span class=\"theme-color font-weight-bold\">Volkswagen </span> Jetta</h2>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4\">\r\n<p class=\"text-center\">Also a family sized car, the Volkswagen Jetta was released in 1979 and has undergone many advancement or improvement to a more fit, desired, and smooth at both look and touch. Bringing every individual closer to the world of beautiful ride in Dubai, UAE, the Volkswagen Jetta features a fuel-efficient system, no obvious flaws, an easy-to-use infotainment system, and most important, a competitive price tag.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell my <span class=\"font-weight-bold\">Volkswagen</span> Passat</h2>\r\n<p class=\"font-mons text-center text-white py-4\">It has been said that the Maserati Quattroporte is part of a story that goes way back to 100years ago. Having being introduced in the year 1963, the Maserati Quattroporte has offered a moderate body with four-door full sized ride. Over time, the Maserati Quattroporte has been brought to its sixth generation and was released in 2016.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-white text-center font-weight-light\">Sell my <span class=\"font-weight-bold\">Volkswagen</span> Teramont</h2>\r\n<p class=\"font-mons text-center text-white py-4\">Towering above its other sport utility vehicle mates, the Volkswagen Teramont is the first three-row SUV that accommodates with high easiness.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Volkswagen | Get Your Volkswagen Evaluated in UAE', NULL, 'Want to sell your Volkswagen? Sell your Volkswagen to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:33:54', '2019-03-05 08:45:57'),
(119, 'Volvo', 'volvo', 0, '<div class=\"subpages-content\">\r\n<div class=\"container-fluid \">\r\n<div class=\"row top_bg whycell theme-bg mb-3\">\r\n<div class=\"col-md-12 text-center\">\r\n<h2 class=\"font-weight-light text-white py-sm-3 text-uppercase\">Volvo</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h2 class=\"text-center font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Volvo</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-12 text-center\">\r\n<p>Founded in 1927, Volvo is one of the oldest car manufacturers in the world. This Swedish car manufacturer has made different series of personal and commercial vehicles over the last century. Reliability, attractiveness, and power are the hallmarks of Volvo vehicles.</p>\r\n<p style=\"width: 100%;\">Are you looking to sell your Volvo car in Dubai and other cities in UAE? Our Volvo specialists at Expat Car Buyers will offer you exception solutions. You can sell your Volvo XC90, Volvo V70, Volvo C70, S60 and other models of Volvo cars to us.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"pt_ninty position-relative\" style=\"margin-top: 50px;\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6\">\r\n<div class=\"why-left-sec\">\r\n<h3 class=\"font-weight-light\" style=\"margin-bottom: 30px;\">Sell My <span class=\"theme-color font-weight-bold\">Volvo XC90</span></h3>\r\n<p>After it was unveiled in Detroit in 2000, Volvo XC90 became one of the most sought-after automobiles in the early 2000s. This compact SUV came with five- and six-cylinder engine variants. This engine, which can produce 315hp, rocked an excellent aluminum V8 unit. With a magnificent off-road appearance, Volvo XC90 can take as much as seven passengers.</p>\r\n<p>If you are interested in selling your Volvo XC90, we are ready to offer you cash for your Volvo XC90.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 p-0\">\r\n<div class=\"subpage-car-img-section\"><img class=\"img-fluid\" src=\"/public/front2/images/volvo-3935684_640.webp\" alt=\"Volvo\" onerror=\"this.onerror=null; this.src=\'/public/front2/images/volvo-3935684_640.png\'\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Volvo V70</span></h3>\r\n<p class=\"font-mons text-white py-2\">Designed based on the look of the Volvo S80, the Volvo V70 was first launched over ten years ago as one of the strongest and most comfortable motorway cruisers. It was known during its foremost years as a premium vehicle with a spacious cabin and luggage space that can make life easy for its passengers. Buyers can choose from two options &ndash; manual or automatic gearbox.</p>\r\n<p class=\"font-mons text-white py-2\" style=\"width: 100%;\">Whatever options of this car you have, you can sell your Volvo V70 online to us anytime you want.</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Volvo S90</span></h3>\r\n<p class=\"font-mons text-white py-2\">The Volvo S90 was launched into the market as a redesigned and improved version of the old Volvo 960. It was manufactured with a reliable six-cylinder, 24-valve gasoline engine that could beat most other vehicles of its time. Many of the Volvo S90 available still have beautiful upholstery, well-designed gear shift, beautiful interior, comfort chassis and so on.</p>\r\n<p class=\"font-mons text-white py-2\">Are done using this car and want to sell it? Sell your Volvo S90 in Dubai to us at Expat Car Buyers.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section class=\"py-5 bg-grey\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Volvo S60</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">The Volvo S60 is a compact luxury sedan with a style that resembles those of the ECC Concept Car and Volvo S80. Unveiled in 2000 and undergone several modifications, this Volvo car has four different versions which are the T5, T6, T8, and T8 Polestar trims. It has a 2.0L engine that delivers about 400bhp.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">You can sell your Volvo S60 for cash without hassle today.</p>\r\n</div>\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-12\">\r\n<h3 class=\"text-center font-weight-light\">Sell My<span class=\"theme-color font-weight-bold\"> Volvo C70</span></h3>\r\n</div>\r\n</div>\r\n<div class=\"row pt-3 py-4 text-center\">\r\n<p class=\"text-center\">This is another extraordinary model of Volvo cars that genuinely offers its buyers the utmost luxury and comfort. Its first generation was unveiled in 1997 while its latest generation was launched in 2006. The reliable and attractive features of this car include first-rate audio system, leather seats, and high-performance engine.</p>\r\n<p class=\"text-center\" style=\"width: 100%;\">Whether you want to sell your Volvo C70 to settle emergency needs or just want to cash your Volvo C70 to buy a replacement car, we are ready to help you.</p>\r\n</div>\r\n</div>\r\n</section>\r\n<div class=\"subpage-bg-section position-relative py-5 text-center\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3 class=\"text-white font-weight-light\">Sell My <span class=\"font-weight-bold\">Volvo</span> for Cash</h3>\r\n<p class=\"font-mons text-white py-2\">At Expat Car Buyers, we buy any models of Volvo cars in UAE. Irrespective of the condition of your Volvo car, our experts will schedule an appointment with you, inspect your car, and give you a quote based on its current value and condition. If you agree with our quotes, we will offer you cash for your Volvo car immediately.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Sell My Volvo | Get Your Volvo Evaluated in UAE', NULL, 'Want to sell your Volvo? Sell your Volvo to ExpatCarBuyers. We purchase all makes and models. Get your car evaluated under 25 minutes in UAE.', '2020-10-01 10:59:46', '2019-03-05 08:46:46'),
